 line exactly as it is --> <pre>\n# 语法像下面这样:\n#   * 所有在 \"#\" 字符后的内容全部是注释\n#   * 所有非空白行是一个正则表达式，只会对URL中的内容进行匹配\n #</pre> <!-- leave this line exactly as it is -->\";'),('zh-cn','messages:right-skipcaptcha','s:39:\"进行触发验证操作时无需验证\";'),('zh-cn','messages:gadgets-desc','s:137:\"允许用户在其[[Special:Preferences#mw-prefsection-gadgets|系统设置]]中选择自定义[[Special:Gadgets|CSS和JavaScript工具]]\";'),('zh-cn','messages:captchahelp-text','s:949:\"像本站一样，对公众开放编辑的网站经常被垃圾连结骚扰。那些人使用自动化垃圾程序将他们的连结张贴到很多网站。虽然这些连结可以被清除，但是这些东西确实令人十分讨厌。\n\n有时，特别是当给一个页面添加新的网页链接时，本站会让你看一幅有颜色的或者有变形文字的图像，并且要你输入所显示的文字。因为这是难以自动完成的一项任务，它将允许人保存他们的编辑，同时阻止大多数发送垃圾邮件者和其他机器人的攻击。\n\n令人遗憾是，这会使得视力不好的人，或者使用基於文本或者基於声音的浏览器的用户感到不便。而目前我们还没有提供的音频的选择。如果这正好阻止你进行正常的编辑，请和[[{{MediaWiki:Grouppage-sysop}}|站点管理员]]联系获得帮助。\n\n点击浏览器中的“后退”按钮返回你所编辑的页面。\";'),('zh-cn','messages:captchahelp-cookies-needed','s:64:\"您需要开启浏览器上的cookies方可使用这个工具。\";'),('zh-cn','messages:captchahelp-title','s:15:\"验证码说明\";'),('zh-cn','messages:captcha-disabledinapi','s:69:\"这个要求需要经过验证码验证，故无法透过API使用。\";'),('zh-cn','messages:captcha-sendemail-fail','s:27:\"验证码错误或丢失。\";'),('zh-cn','messages:captcha-sendemail','s:157:\"为了防止自动垃圾程序进行破坏，我们恳请您答出一个简单的计算，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-cn','messages:captcha-create','s:117:\"要创建页面，请答出一个简单的加法，然後在框内输入 （[[Special:Captcha/help|更多资料]]）:\";'),('zh-cn','messages:captcha-createaccount-fail','s:27:\"验证码错误或丢失。\";'),('zh-cn','messages:captcha-createaccount','s:151:\"为了防止自动程序注册账号，我们恳请您答出一个简单的加法，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-cn','messages:captcha-badlogin','s:151:\"为了防止自动程序破解密码，我们恳请您答出一个简单的加法，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-cn','messages:captcha-addurl','s:230:\"您编辑的内容中含有一个新的外部链接；为了免受自动垃圾程序的侵扰，请答出一个简单的加法，并在下面的框内输入答案才能保存您的编辑（[[Special:Captcha/help|更多信息]]）:\";'),('zh-cn','messages:captcha-label','s:9:\"验证码\";'),('zh-cn','messages:captcha-desc','s:57:\"通过验证码技术来阻止垃圾邮件和密码猜解\";'),('zh-cn','messages:captcha-edit','s:123:\"要编辑这篇文章，请答出一个简单的加法，然後在框内输入 （[[Special:Captcha/help|更多资料]]）:\";'),('zh-cn','messages: