es:newtitle','s:12:\"新标题：\";'),('zh-hans','messages:cant-move-to-user-page','s:72:\"你没有权限移动页面至用户页面（用户子页面除外）。\";'),('zh-hans','messages:cant-move-user-page','s:57:\"你没有权限移动用户页面（子页面除外）。\";'),('zh-hans','messages:movenotallowed','s:30:\"你没有权限移动页面。\";'),('zh-hans','messages:movenologintext','s:95:\"您必须是一名登记用户并且[[Special:UserLogin|登录]]\n后才可移动一个页面。\";'),('zh-hans','messages:movenotallowedfile','s:30:\"你没有权限移动文件。\";'),('zh-hans','messages:movenologin','s:9:\"未登录\";'),('zh-hans','messages:moveuserpage-warning','s:121:\"\'\'\'警告：\'\'\'你将移动一个用户页面。请注意，只有该页面会被移动，该用户\'\'不\'\'会被更名。\";'),('zh-hans','messages:movearticle','s:15:\"移动页面：\";'),('zh-hans','messages:movepagetalktext','s:238:\"有关的讨论页将被自动与该页面一起移动，\'\'\'除非\'\'\':\n*新页面已经有一个包含内容的讨论页，或者\n*您不勾选下面的复选框。\n\n在这些情况下，您在必要时必须手工移动或合并页面。\";'),('zh-hans','messages:movepagetext-noredirectfixer','s:758:\"用下面的表单来重命名一个页面，并将其修订历史同时移动到新页面。\n老的页面将成为新页面的重定向页。\n请检查[[Special:DoubleRedirects|双重重定向]]或[[Special:BrokenRedirects|损坏重定向]]链接。\n您应当负责确定所有链接依然会链到指定的页面。\n\n注意如果新页面已经有内容的话，页面将\'\'\'不会\'\'\'被移动，\n除非新页面无内容或是重定向页，而且没有修订历史。\n这意味着您再必要时可以在移动到新页面后再移回老的页面，\n同时您也无法覆盖现有页面。\n\n\'\'\'警告！\'\'\'\n对一个经常被访问的页面而言这可能是一个重大与唐突的更改；\n请在行动前先确定您了解其所可能带来的后果。\";'),('zh-hans','messages:movepagetext','s:835:\"您可以使用下面的表单来重命名一个页面，同时将其修订历史移动到新页面。\n同时老的条目将会被重定向到新条目。\n您可以自动地将重定向更新到原条目。\n如果您不选择这样做的话，请检查[[Special:DoubleRedirects|双重]]或[[Special:BrokenRedirects|损坏重定向]]链接。\n您有责任确保链接会被正确指向他们应该被指向的地方。\n\n注意：即使新条目已经有对应页面，此页面也\'\'\'不会\'\'\'被移动，除非新页面无任何编辑历史或是重定向页。\n这意味着您可在误操作后将页面移回原处，同时，您也无法覆盖现有页面。\n\n\'\'\'警告！\'\'\'\n对这样一个经常被访问的页面而言这可能是一个重大且唐突的更改；\n请在行动前先了解您的修改可能带来的一切后果。\";'),('zh-hans','messages:lockedbyandtime','s:41:\"（由 {{GENDER:$1|$1}} 于$2 $3执行）\";'),('zh-hans','messages:move-page-legend','s:12:\"移动页面\";'),('zh-hans','messages:move-page','s:8:\"移动$1\";'),('zh-hans','messages:databasenotlocked','s:24:\"数据库没有锁定。\";'),('zh-hans','messages:lockfilenotwritable','s:105:\"数据库锁定文件不可写。要锁定和解锁数据库，该文件必须对网络服务器可写。\";'),('zh-hans','messages:unlockdbsuccesstext','s:21:\"数据库已解锁。\";'),('zh-hans',