-hans','messages:sitecsspreview','s:66:\"\'\'\'请记住你现在只是在预览该CSS。它尚未保存！\'\'\'\";'),('zh-hans','messages:usercsspreview','s:75:\"\'\'\'请记住你现在只是在预览你的用户CSS。它尚未保存！\'\'\'\";'),('zh-hans','messages:userjspreview','s:89:\"\'\'\'请记住你现在只是在测试/预览你的用户JavaScript。它尚未保存！\'\'\'\";'),('zh-hans','messages:userjsyoucanpreview','s:98:\"\'\'\'提示：\'\'\' 在保存前请用“{{int:showpreview}}”按钮来测试您新的 JavaScript 。\";'),('zh-hans','messages:usercssyoucanpreview','s:91:\"\'\'\'提示：\'\'\' 在保存前请用“{{int:showpreview}}”按钮来测试您新的 CSS 。\";'),('zh-hans','messages:clearyourcache','s:460:\"\'\'\'注意：\'\'\'保存之后，你必须清除浏览器缓存才能看到做出的更改。\n* \'\'\'火狐（Firefox）/Safari：\'\'\'按住“Shift”，同时单击“刷新”，或按“Ctrl-F5”或“Ctrl-R”（Mac为“⌘-R”）\n* \'\'\'Google Chrome：\'\'\'按“Ctrl-Shift-R”（Mac为“⌘-Shift-R”）\n* \'\'\'Internet Explorer：\'\'\'按住“Ctrl”，同时单击“刷新”，或按“Ctrl-F5”\n* \'\'\'Opera：\'\'\'在“工具→首选项”中清除缓存\";'),('zh-hans','messages:blocked-notice-logextract','s:81:\"这位用户目前已被封禁。以下提供最近的封禁日志以供参考：\";'),('zh-hans','messages:userpage-userdoesnotexist-view','s:35:\"用户账户“$1”未曾创建。\";'),('zh-hans','messages:userpage-userdoesnotexist','s:72:\"用户账户“$1”没有注册。请在创建/编辑本页前检查。\";'),('zh-hans','messages:missing-revision','s:223:\"“{{PAGENAME}}”的修订#$1不存在。\n\n这通常是因为进入了一个已被删除的页面的历史链接。\n详细信息可以在[{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} 删除日志]中找到。\";'),('zh-hans','messages:noarticletext-nopermission','s:246:\"本页面目前没有内容。你可以在其他页面中[[Special:Search/{{PAGENAME}}|搜索本页标题]]或<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} 搜索相关日志]，但你没有权限创建本页面。\";'),('zh-hans','messages:anontalkpagetext','s:360:\"---- \'\'这是一个还未建立账户的匿名用户的讨论页, 因此我们只能用IP地址来与他或她联络。该IP地址可能由几名用户共享。如果您是一名匿名用户并认为此页上的评语与您无关，请[[Special:UserLogin/signup|创建新账户]]或[[Special:UserLogin|登录]]以避免在未来与其他匿名用户混淆。\'\'\";'),('zh-hans','messages:noarticletext','s:278:\"本页面目前没有内容。你可以在其他页面中[[Special:Search/{{PAGENAME}}|搜索本页标题]]、<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} 搜索相关日志]或[{{fullurl:{{FULLPAGENAME}}|action=edit}} 编辑本页面]。</span>\";'),('zh-hans','messages:new