-pagetext','s:281:\"下面是用户可以在他们的[[Special:Preferences#mw-prefsection-gadgets|设置页面]]启用的特殊小工具的列表，由[[MediaWiki:Gadgets-definition|定义]]确定。这个概览提供便捷访问确定每个小工具的说明和代码的系统信息页面的途径。\";'),('zh-hans','messages:gadgets-title','s:9:\"小工具\";'),('zh-hans','messages:gadgets','s:9:\"小工具\";'),('zh-hans','messages:gadgets-prefstext','s:511:\"下面是你可以为你的账户启用的特殊小工具的列表。这些小工具大多数基于JavaScript，所以你必需使你的浏览器启用JavaScript以使它们工作。请注意这些小工具不会在这个设置页面上产生效果。\n\n同时请注意，这些特殊小工具不是MediaWiki软件的组成部分，他们通常是由你的本地wiki的用户开发并维护的。本地管理员可以编辑可用小工具的[[MediaWiki:Gadgets-definition|定义]]和[[Special:Gadgets|说明]]。\";'),('zh-hans','messages:prefs-gadgets','s:9:\"小工具\";'),('zh-hans','messages:gadgets-desc','s:137:\"允许用户在其[[Special:Preferences#mw-prefsection-gadgets|系统设置]]中选择自定义[[Special:Gadgets|CSS和JavaScript工具]]\";'),('zh-hans','messages:right-skipcaptcha','s:39:\"进行触发验证操作时无需验证\";'),('zh-hans','messages:captcha-addurl-whitelist','s:267:\" #<!-- leave this line exactly as it is --> <pre>\n# 语法像下面这样:\n#   * 所有在 \"#\" 字符后的内容全部是注释\n#   * 所有非空白行是一个正则表达式，只会对URL中的内容进行匹配\n #</pre> <!-- leave this line exactly as it is -->\";'),('zh-hans','messages:captchahelp-text','s:938:\"像本站一样，对公众开放编辑的网站经常被垃圾连结骚扰。那些人使用自动化垃圾程序将他们的连结张贴到很多网站。虽然这些连结可以被清除，但是这些东西确实令人十分讨厌。\n\n有时，特别是当给一个页面添加新的网页链接时，本站会让你看一幅有颜色的或者有变形文字的图像，并且要你输入所显示的文字。因为这是难以自动完成的一项任务，它将允许人保存他们的编辑，同时阻止大多数发送垃圾邮件者和其他机器人的攻击。\n\n令人遗憾是，这会使得视力不好的人，或者使用基於文本或者基於声音的浏览器的用户感到不便。而目前我们还没有提供的音频的选择。如果这正好阻止你进行正常的编辑，请和[[Special:ListAdmins|站点管理员]]联系获得帮助。\n\n点击浏览器中的“后退”按钮返回你所编辑的页面。\";'),('zh-hans','messages:captchahelp-cookies-needed','s:64:\"您需要开启浏览器上的cookies方可使用这个工具。\";'),('zh-hans','messages:captchahelp-title','s:15:\"验证码说明\";'),('zh-hans','messages:captcha-disabledinapi','s:69:\"这个要求需要经过验证码验证，故无法透过API使用。\";'),('zh-hans','messages:captcha-sendemail-fail','s:27:\"验证码错误或丢失。\";'),('zh-hans','messages:captcha-sendemail','s:157:\"为了防止自动垃圾程序进行破坏，我们恳请您答出一个简单的计算，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-hans','messages:captcha-create','s:117:\"要创建页面，请答出一个简单的加法，然後在框内输入 （[[Special:Captcha/help|更多资料]]）:\";'),('zh-hans','messages:captcha-createaccount-fail','s:27:\"验证码错误或丢失。\";'),('zh-hans','messages:captcha-createaccount','s:151:\"为了防止自动程序注册账号，我们恳请您答出一个简单的加法，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-hans','messages:captcha-badlogin','s:151:\"为了防止自动程序破解密码，我们恳请您答出一个简单的加法，然后在框内输入（[[Special:Captcha/help|详细信息]]）：\";'),('zh-hans','messages:captcha-addurl','s:230:\"您编辑的内容中含有一个新的外部链接；为了免受自动垃圾程序的侵扰，请答出一个简单的加法，并在下面的框内输入答案才能保存您的编辑（[[Special:Captcha/help|更多信息]]）:\";'),('zh-hans','messages:captcha-label','s:9:\"验证码\";'),('zh-hans','messages:captcha-desc','s:57:\"通过验证码技术来阻止垃圾邮件和密码猜解\";'),('zh-hans','messages:captcha-edit','s:123:\"要编辑这篇文章，请答出一个简单的加法，然後在框内输入 （[[Special:Captcha/help|更多资料]]）:\";'),('zh-hans','messages:cite_references_suffix','s:5:\"</ol>\";'),('zh-hans','messages:cite_references_prefix','s:23:\"<ol class=\"references\">\";'),('zh-hans','messages:cite_references_link_many_and','s:5:\"&#32;\";'),('zh-hans','messages:cite_references_link_many_sep','s:5:\"&#32;\";'),('zh-hans','messages:cite_error_references_invalid_parameters_group','s:171:\"无效<code>&lt;references&gt;</code>标签；只允许填写“group”参数，请使用<code>&lt;references /&gt;</code>或<code>&lt;references group=\"...\" /&gt;</code>\";'),('zh-hans','messages:cite_error_references_no_backlink_label','s:142:\"自定义回链标签耗尽，请在<nowiki>[[MediaWiki:Cite references link many format backlink labels]]</nowiki>中定义更多的标签。\";'),('zh-hans','messages:cite_error_no_link_label_group','s:110:\"组“$1”的自定义链接标签耗尽，请在<nowiki>[[MediaWiki:$2]]</nowiki>中定义更多的标签。\";'),('zh-hans','messages:cite_error_references_no_text','s:94:\"无效<code>&lt;ref&gt;</code>标签；未给name属性为<code>$1</code>的引用提供文字\";'),('zh-hans','messages:cite_error_included_ref','s:79:\"没有找到与<code>&lt;/ref&gt;</code>对应的<code>&lt;ref&gt;</code>标签\";'),('zh-hans','messages:cite_error_refs_without_references','s:92:\"<code>&lt;ref&gt;</code>标签存在，但没有找到<code>&lt;references/&gt;</code>标签\";'),('zh-hans','messages:cite_error_group_refs_without_references','s:184:\"组名为“$1”的<code>&lt;ref&gt;</code>标签存在，但没有找到相应的<cod