n their [[Special:Preferences#mw-prefsection-gadgets|preferences page]], as defined by the [[MediaWiki:Gadgets-definition|definitions]].\nThis overview provides easy access to the system message pages that define each gadget\'s description and code.\";'),('en','messages:gadgets-definition','s:0:\"\";'),('en','messages:gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-prefstext','s:535:\"Below is a list of special gadgets you can enable for your account.\nThese gadgets are mostly based on JavaScript, so JavaScript has to be enabled in your browser for them to work.\nNote that these gadgets will have no effect on this preferences page.\n\nAlso note that these special gadgets are not part of the MediaWiki software, and are usually developed and maintained by users on your local wiki.\nLocal administrators can edit the [[MediaWiki:Gadgets-definition|definitions]] and [[Special:Gadgets|descriptions]] of available gadgets.\";'),('en','messages:prefs-gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-desc','s:139:\"Lets users select custom [[Special:Gadgets|CSS and JavaScript gadgets]] in their [[Special:Preferences#mw-prefsection-gadgets|preferences]]\";'),('en','messages:right-skipcaptcha','s:75:\"Perform CAPTCHA-triggering actions without having to go through the CAPTCHA\";'),('en','messages:captcha-addurl-whitelist','s:285:\" #<!-- leave this line exactly as it is --> <pre>\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:captchahelp-text','s:924:\"Web sites that accept postings from the public, like this wiki, are often abused by spammers who use automated tools to post their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may show you an image of colored or distorted text and ask you to type the words shown.\nSince this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.\n\nUnfortunately this may inconvenience users with limited vision or using text-based or speech-based browsers.\nAt the moment we do not have an audio alternative available.\nPlease contact the  [[Special:ListAdmins|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate actions.\n\nHit the \"back\" button in your browser to return to the page editor.\";'),('en','messages:captchahelp-cookies-needed','s:71:\"You will need to have cookies enabled in your browser for this to work.\";'),('en','messages:captchahelp-title','s:12:\"CAPTCHA help\";'),('en','messages:captcha-disabledinapi','s:74:\"This action requires a captcha, so it cannot be performed through the API.\";'),('en','messages:captcha-sendemail-fail','s:39:\"Incorrect or missing confirmation code.\";'),('en','messages:captcha-sendemail','s:165:\"To protect the wiki against automated spamming, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-create','s:123:\"To create the page, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-createaccount-fail','s:39:\"Incorrect or missing confirmation code.\";'),('en','messages:captcha-createaccount','s:173:\"To protect the wiki against automated account creation, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-badlogin','s:174:\"To protect the wiki against automated password cracking, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-ad