INSERT INTO `text` VALUES (1,'\'\'\'已成功安装MediaWiki。\'\'\'\n\n请查阅[//meta.wikimedia.org/wiki/Help:Contents 用户指南]以获取使用本wiki软件的信息！\n\n== 入门 ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings MediaWiki配置设置列表]\n* [//www.mediawiki.org/wiki/Manual:FAQ/zh-hans MediaWiki常见问题]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki发布邮件列表]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources 本地化MediaWiki到您的语言]','utf-8'),(2,'The A+B Problem\n\n问题描述\n\n----\n\nCalculate a+b\n\n计算 a+b\n\nPlease read the Hint!!!\n\n请注意阅读提示！！！\n\n\n\n输入\n\n----\n\nTwo integer a,b (0<=a,b<=10)\n\n两个整数 a,b﻿&nbsp;(0<=a,b<=10)\n\n<span lang=\"en\" id=\"result_box\" class=\"short_text\">Multiple sets of data，</span>End with EOF\n\n有多组数据输入，以EOF结束\n\n\n\n输出\n\n----\n\nOutput a+b\n\n输出 a+b\n\n\n\n样例输入\n\n----\n\n1 2\n\n2 4\n\n\n\n\n\n样例输出\n\n----\n\n3\n\n6\n\n\n\n提示\n\n----\n\nQ: Where are the input and the output?\n\nQ:在哪里进行输入输出？<br/><br/>A: Your program shall always&nbsp;<font color=\"red\">read input from stdin (Standard Input) and write output to stdout (Standard Output)</font>. For example, you can use \'scanf\' in C or \'cin\' in C++ to read from stdin, and use \'printf\' in C or \'cout\' in C++ to write to stdout.\n\nA:你的程序应该<span style=\"color: rgb(255, 0, 0);\">总是从标准输入stdin中读取数据，向标准输出stdout中写入数据</span>。比如，在C/C++中，你可以使用scanf/cin来从stdin中读取数据，使用printf/cout来向stdout中写入数据\n\nYou&nbsp;<font color=\"red\">shall not output any extra data</font>&nbsp;to standard output other than that required by the problem, otherwise you will get a \"Wrong Answer\".\n\n<span style=\"color: rgb(255, 0, 0);\">不要输出任何未在输出格式说明中列出的数据</span>，否则无论计算是否正确，你提交的程序都将会被判定为“Wrong Answer”（答案错误）。<br/>User programs are not allowed to open and read from/write to files. You will get a \"Runtime Error\" or a \"Wrong Answer\"if you try to do so.\n\n尝试读写文件的程序是不被系统允许的，如果执意如此，你提交的程序将被判定为“Runtime Error”（运行时错误）或者“Wrong Answer”。\n\n<span style=\"font-size:small;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Here is a sample solution to problem 1000 using C/GCC:</span></span>\n\n使用C编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <stdio.h>\nint main()\n{\n&nbsp;&nbsp;&nbsp; int a,b;\n&nbsp; &nbsp; while(scanf(\"%d&nbsp;%d\",&a, &b)!=EOF)\n    {\n&nbsp; &nbsp;     printf(\"%d\\n\",a+b);\n    }\n&nbsp; &nbsp; return 0;\n}</pre>\nHere is a sample solution to problem 1000 using C++/G++:\n\n使用C++编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <iostream>\nusing namespace std;\nint main()\n{\n    int a,b;\n    while(cin>> a>> b)\n        cout << a+b << endl;\n    return 0;\n}\n</pre>\n<br/><span style=\"color: rgb(255, 0, 0);\">It\'s important that the return type of main() must be int when you use G++/GCC,or you may get compile error.</span>\n\n<span style=\"color: rgb(255, 0, 0);\">注意：使用G++/GCC时，main()函数的返回类型必须为int，否则你提交的程序将被判定为“Compile Error”（编译错误）</span>','utf-8'),(3,'= The A+B Problem =\n\n== 关于问题 ==\n\n=== 问题描述 ===\n\nCalculate a+b\n\n计算 a+b\n\nPlease read the Hint!!!\n\n请注意阅读提示！！！\n\n\n\n=== 输入 ===\n\nTwo integer a,b (0<=a,b<=10)\n\n两个整数 a,b﻿&nbsp;(0<=a,b<=10)\n\n<span lang=\"en\" id=\"result_box\" class=\"short_text\">Multiple sets of data，</span>End with EOF\n\n有多组数据输入，以EOF结束\n\n\n\n=== 输出 ===\n\nOutput a+b\n\n输出 a+b\n\n\n\n=== 样例输入 ===\n\n1 2\n\n2 4\n\n\n\n=== 样例输出 ===\n\n3\n\n6\n\n=== 提示 ===\n\nQ: Where are the input and the output?\n\nQ:在哪里进行输入输出？<br/><br/>A: Your program shall always&nbsp;<font color=\"red\">read input from stdin (Standard Input) and write output to stdout (Standard Output)</font>. For example, you can use \'scanf\' in C or \'cin\' in C++ to read from stdin, and use \'printf\' in C or \'cout\' in C++ to write to stdout.\n\nA:你的程序应该<span style=\"color: rgb(255, 0, 0);\">总是从标准输入stdin中读取数据，向标准输出stdout中写入数据</span>。比如，在C/C++中，你可以使用scanf/cin来从stdin中读取数据，使用printf/cout来向stdout中写入数据\n\nYou&nbsp;<font color=\"red\">shall not output any extra data</font>&nbsp;to standard output other than that required by the problem, otherwise you will get a \"Wrong Answer\".\n\n<span style=\"color: rgb(255, 0, 0);\">不要输出任何未在输出格式说明中列出的数据</span>，否则无论计算是否正确，你提交的程序都将会被判定为“Wrong Answer”（答案错误）。<br/>User programs are not allowed to open and read from/write to files. You will get a \"Runtime Error\" or a \"Wrong Answer\"if you try to do so.\n\n尝试读写文件的程序是不被系统允许的，如果执意如此，你提交的程序将被判定为“Runtime Error”（运行时错误）或者“Wrong Answer”。\n\n<span style=\"font-size:small;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Here is a sample solution to problem 1000 using C/GCC:</span></span>\n\n使用C编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <stdio.h>\nint main()\n{\n&nbsp;&nbsp;&nbsp; int a,b;\n&nbsp; &nbsp; while(scanf(\"%d&nbsp;%d\",&a, &b)!=EOF)\n    {\n&nbsp; &nbsp;     printf(\"%d\\n\",a+b);\n    }\n&nbsp; &nbsp; return 0;\n}</pre>\nHere is a sample solution to problem 1000 using C++/G++:\n\n使用C++编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <iostream>\nusing namespace std;\nint main()\n{\n    int a,b;\n    while(cin>> a>> b)\n        cout << a+b << endl;\n    return 0;\n}\n</pre>\n<br/><span style=\"color: rgb(255, 0, 0);\">It\'s important that the return type of main() must be int when you use G++/GCC,or you may get compile error.</span>\n\n<span style=\"color: rgb(255, 0, 0);\">注意：使用G++/GCC时，main()函数的返回类型必须为int，否则你提交的程序将被判定为“Compile Error”（编译错误）</span>','utf-8'),(4,'= <span style=\"font-size: 12px;\">关于问题</span> =\n\n== 问题描述 ==\n\nCalculate a+b\n\n计算 a+b\n\nPlease read the Hint!!!\n\n请注意阅读提示！！！\n\n\n\n== 输入 ==\n\nTwo integer a,b (0<=a,b<=10)\n\n两个整数 a,b﻿&nbsp;(0<=a,b<=10)\n\n<span lang=\"en\" id=\"result_box\" class=\"short_text\">Multiple sets of data，</span>End with EOF\n\n有多组数据输入，以EOF结束\n\n\n\n== 输出 ==\n\nOutput a+b\n\n输出 a+b\n\n\n\n== 样例输入 ==\n\n1 2\n\n2 4\n\n\n\n== 样例输出 ==\n\n3\n\n6\n\n== 提示 ==\n\nQ: Where are the input and the output?\n\nQ:在哪里进行输入输出？<br/><br/>A: Your program shall always&nbsp;<font color=\"red\">read input from stdin (Standard Input) and write output to stdout (Standard Output)</font>. For example, you can use \'scanf\' in C or \'cin\' in C++ to read from stdin, and use \'printf\' in C or \'cout\' in C++ to write to stdout.\n\nA:你的程序应该<span style=\"color: rgb(255, 0, 0);\">总是从标准输入stdin中读取数据，向标准输出stdout中写入数据</span>。比如，在C/C++中，你可以使用scanf/cin来从stdin中读取数据，使用printf/cout来向stdout中写入数据\n\nYou&nbsp;<font color=\"red\">shall not output any extra data</font>&nbsp;to standard output other than that required by the problem, otherwise you will get a \"Wrong Answer\".\n\n<span style=\"color: rgb(255, 0, 0);\">不要输出任何未在输出格式说明中列出的数据</span>，否则无论计算是否正确，你提交的程序都将会被判定为“Wrong Answer”（答案错误）。<br/>User programs are not allowed to open and read from/write to files. You will get a \"Runtime Error\" or a \"Wrong Answer\"if you try to do so.\n\n尝试读写文件的程序是不被系统允许的，如果执意如此，你提交的程序将被判定为“Runtime Error”（运行时错误）或者“Wrong Answer”。\n\n<span style=\"font-size:small;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Here is a sample solution to problem 1000 using C/GCC:</span></span>\n\n使用C编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <stdio.h>\nint main()\n{\n&nbsp;&nbsp;&nbsp; int a,b;\n&nbsp; &nbsp; while(scanf(\"%d&nbsp;%d\",&a, &b)!=EOF)\n    {\n&nbsp; &nbsp;     printf(\"%d\\n\",a+b);\n    }\n&nbsp; &nbsp; return 0;\n}</pre>\nHere is a sample solution to problem 1000 using C++/G++:\n\n使用C++编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <iostream>\nusing namespace std;\nint main()\n{\n    int a,b;\n    while(cin>> a>> b)\n        cout << a+b << endl;\n    return 0;\n}\n</pre>\n<br/><span style=\"color: rgb(255, 0, 0);\">It\'s important that the return type of main() must be int when you use G++/GCC,or you may get compile error.</span>\n\n<span style=\"color: rgb(255, 0, 0);\">注意：使用G++/GCC时，main()函数的返回类型必须为int，否则你提交的程序将被判定为“Compile Error”（编译错误）</span>','utf-8'),(5,'= 区间求和问题 =\n\n== 题目描述<br/> ==\n\n接上一题。这次不是求a+b，而是求a和b之间所有整数的和\n\n== 输入<br/> ==\n\n<span style=\"font-size: 12px;\">每行两个整数a b(输入数据保证a<=b)</span>\n\n多组输入，以EOF结束\n\n== 输出 ==\n\n每行一个整数k,表示所求之和\n\n== 样例输入 ==\n\n1 2<br/>3 5\n\n== <br/>样例输出 ==\n\n3<br/>12','utf-8'),(6,'= 区间求和问题 =\n\n== 题目描述<br/> ==\n\n接上一题。这次不是求a+b，而是求a和b之间所有整数的和\n\n== 输入<br/> ==\n\n<span style=\"font-size: 12px;\">每行两个整数a b(输入数据保证a<=b)</span>\n\n多组输入，以EOF结束\n\n== 输出 ==\n\n每行一个整数k,表示所求之和\n\n== 样例输入 ==\n\n1 2<br/>3 5\n\n== 样例输出 ==\n\n3<br/>12','utf-8'),(7,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0','utf-8'),(8,'= 整数倒置问题 =\n\n== 题目描述 ==\n\nLB学长有个很怪异的爱好，在他写给基友的信息中，总喜欢把数字倒过来写，比如把123写成321，虽然不知道为什么，但是感觉很厉害的样子～\n\n== 输入 ==\n\n每行一个整数a，(0<=a<=999999999)\n\n== 输出 ==\n\n每行一个倒置过后的整数k&nbsp;&nbsp;&nbsp; 注意：「不忽略开头的零」\n\n== 样例输入 ==\n\n123<br/>237<br/>100\n\n== 样例输出 ==\n\n321<br/>732<br/>001','utf-8'),(9,'= 关于问题 =\n\n== 题目描述 ==\n\n求自然数M，N的最大公约数\n\n== 输入 ==\n\n每行2个整数m, n\n\n== 输出 ==\n\n每行一个整整数k, k是m和n的最大公约数\n\n== 样例输入 ==\n\n3 9<br/>6 9<br/>16 64\n\n== 样例输出 ==\n\n3<br/>3<br/>16<br/>提示<br/>遇到了TLE？寻找更有效的方法来解决问题<br/>For C++ Programer<br/>DO NOT USE CIN or COUT\n\n= 关于最大公约数算法<br/><br/> =','utf-8'),(10,'= 关于问题 =\n\n== 题目描述 ==\n\n计算输入的字符串中字母\'a’出现的次数（包括大小写）。\n\n== 输入 ==\n\nn个字符，以\'#\'结尾。n<=1000000\n\n== 输出 ==\n\n字母\'a\'出现的次数。\n\n== 样例输入 ==\n\nhuang#\n\n== 样例输出 ==\n\n1','utf-8'),(11,'= 关于问题 =\n\n== 问题描述 ==\n\n蒋神的数学功力之深，纵使是他所有的小伙伴们组团来战，犹恐不及十一。\n\n有一天，蒋神心血来潮创造了这样一个数列：\n\nF(n) = 2,&nbsp; 0<=n<4\n\nF(n) =[(n-1)F(n-1) + (n-2)F(n-2)] mod n, n>=4\n\n蒋神的数列有一个奇怪的性质，那就是。。。你猜？\n\n== 输入 ==\n\n每行一个非负整数N, 零<=N<=二十亿\n\n数据有多行\n\n== 输出 ==\n\n每行一个整数K，K=F(N)\n\n== 样例输入 ==\n\n3<br/>4<br/>5<br/>6\n\n== 样例输出 ==\n\n2<br/>2<br/>4<br/>4\n\n= 关于题解 =','utf-8'),(12,'<blockquote><div><strike>\'\'\'重要提示：本页含有大量无节操内容，执意阅读，后果自负。\'\'\'</strike><br/></div></blockquote><div><br/></div>\n= SSSTA-Wiki 大事记 =\n\n== 2013 ==\n\n=== 2013-Q4 ===\n<div><br/></div><div>2013-10-02</div><div><br/></div><div>费尽九牛顿二Tesla虎之力终于把Mediawiki部署好了，换个LOGO妥妥的，开源世界真伟大。</div><div>The First Contest的题目都被复刻好了，就差题解了。</div><div>怨念下，[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）需要一个高大上的编辑器！！！</div><div><br/></div><div>2013-10-03</div><div><br/></div><div>参考各种手册让最新版的Mediawiki用上了现在你们看得到的在线编辑器</div><div><br/></div><div>2013-10-04</div><div><br/></div><div>开始维护SSSTA-Wiki大事记</div><div>开始酝酿《诸神的故事》</div><div>\n----\n随机更新中...</div><div><br/></div><div><br/></div>','utf-8'),(13,'== SSSTA OJ ==\n\n=== 关于 ===\n\nSSSTA OJ，即SSSTA Online Judge，是西电软院科协为了向全体成员提供一个可以统一调戏C/C++/Java/……等语言的实验平台、技术道场和能力测试工具而架设的Online Judge系统。SSSTA由[https://code.google.com/p/hustoj/ \'\'\'HUST OJ 开源版\'\'\']驱动，于2013年秋季上线公测，截止至2013年10月4日仍然处在不断的二次开发与测试中。','utf-8'),(14,'== SSSTA OJ ==\n\n=== 关于 ===\n\nSSSTA OJ，即SSSTA Online Judge，是西电软院科协为了向全体成员提供一个可以统一调戏C/C++/Java/……等语言的实验平台、技术道场和能力测试工具而架设的Online Judge系统。SSSTA由[https://code.google.com/p/hustoj/ <b>HUST OJ 开源版</b>]驱动，于2013年秋季上线公测，截止至{{CURRENTYEAR}}年{{CURRENTMONTH}}月{{CURRENTDAY}}日仍然处在不断的二次开发与测试中。','utf-8'),(15,'大飞神是科协的大神','utf-8'),(16,'= 关于 =\n\n<span style=\"font-size: 12px;\">First Contest正式开始于</span>[[SSSTA OJ]]<span style=\"font-size: 12px;\">初步成功架设的第2天</span>\'\'\',以 C语言的基础应用\'\'\'<span style=\"font-size: 12px;\">为纲。</span>\n\n= 题目列表 =\n\n*[[The A+B Problem]]\n*[[区间求和问题]]\n*[[日期计算问题]]\n*[[整数倒置问题]]\n*[[最大公约数问题]]\n*[[蒋神统计a的个数]]\n*[[蒋神的迷之数列]]','utf-8'),(17,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n&lt;span style=\"font-size:x-large;\"</span&gt;&lt;span style=\"font-size:x-large;\"</span&gt;\n\n----\n\n== Wiki君的迷之优选 ==\n\n*[[First Contest]]\n*[[2013国庆N题斩]]','utf-8'),(18,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n*[[First Contest]]\n*[[2013国庆N题斩]]','utf-8'),(19,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n*[[First Contest]]\n*[[2013国庆N题斩]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(20,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(21,'= 综述 =\n\n《SSSTA编年史·诸神之怒》是《[[SSSTA编年史]]》系列<strike>同志</strike>同人接力<strike>玄幻小说</strike>纪实文学的第一部，也是SSSTA发起的第一个开放<strike>玄幻小说</strike>纪实文学修编计划。从根本属性上来说，《SSSTA编年史·诸神之怒》是\'\'\'SSSTA 2012级成员的<strike>故事</strike>档案集\'\'\'。在简单了解人物<strike>设定</strike>个性与<strike>故事</strike>历史背景后，所有成员均可以<strike>充分发挥自己的想象力与黑人功里</strike>本着尊重现实的原则自由地构思、创作、提交自己的作品。为了保证《诸神之怒》的质量，<strike>黑的太轻</strike>不尊重现实的作品将不会被总目录收录【注：wiki君不会删除任何水表容忍限度之内的作品，你的作品依然是对所有人可见的， 但这不意味着它一定会出现在《诸神之怒》的主目录里】。\n\n“接力小说”是一种建立在社交网路基础上的同人作品形式。由此创生的《SSSTA编年史》系列<strike>玄幻小说</strike>纪实文学是基于[[SSSTA-Wiki]]的同人作品集。其修编工程于2013年10月04日晚立项，尚处于<strike>绅士</strike>作者征集阶段。由于每位参编人员都将面临节操耗尽的生死威胁，本计划至今只有wiki君[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）一人维持。\n\n= 诸神之怒 =\n\n山无陵\n\n= 作品集 =','utf-8'),(22,'= 综述 =\n\n《SSSTA编年史·诸神之怒》是《[[SSSTA编年史]]》系列<strike>同志</strike>同人接力<strike>玄幻小说</strike>纪实文学的第一部，也是SSSTA发起的第一个开放<strike>玄幻小说</strike>纪实文学修编计划。从根本属性上来说，《SSSTA编年史·诸神之怒》是\'\'\'SSSTA 2012级成员的<strike>故事</strike>档案集\'\'\'。在简单了解人物<strike>设定</strike>个性与<strike>故事</strike>历史背景后，所有成员均可以<strike>充分发挥自己的想象力与黑人功里</strike>本着尊重现实的原则自由地构思、创作、提交自己的作品。为了保证《诸神之怒》的质量，<strike>黑的太轻</strike>不尊重现实的作品将不会被总目录收录【注：wiki君不会删除任何水表容忍限度之内的作品，你的作品依然是对所有人可见的， 但这不意味着它一定会出现在《诸神之怒》的主目录里】。\n\n“接力小说”是一种建立在社交网路基础上的同人作品形式。由此创生的《SSSTA编年史》系列<strike>玄幻小说</strike>纪实文学是基于[[SSSTA-Wiki]]的同人作品集。其修编工程于2013年10月04日晚立项，尚处于<strike>绅士</strike>作者征集阶段。由于每位参编人员都将面临节操耗尽的生死威胁，本计划至今只有wiki君[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）一人维持。\n\n= 诸神之怒序 =\n\n想彼太平不易之元，蓉桂竞芳之月，无可奈何之日，2012年的SSSTA见面会上，痴望着TA，喃喃着”山无陵，江水为竭，冬雷震震，夏雨雪，天地合，乃敢与君绝“的，有蒋神。\n\n一年后，从[[The δ]]之巅到[[B楼]]之下，细听，蒋神郁结的怨念已经化成了冥冥之间的低吼：”Soap Drop, Soap Drop, Soap Drop...\"\n\n\n\n一年又一年，肥皂与基情齐飞，代码共星夜一色的日子过得不慢不紧。[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）一直在想，是不是应该设法让大家一起创造点什么东西，找点乐子，留点纪念。托管在Github上的StackEdit，或者Google Docs，就多完成《诸神之怒》一类的作品集来说来说实在是不尽如人意，终于，我们现在有了[[SSSTA-Wiki|自己的Wiki]]，可以做点什么了。\n\n= 作品集 =','utf-8'),(23,'Wiki君就是[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]），但[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）绝不仅仅是Wiki君。','utf-8'),(24,'= 关于问题 =\n\n== 题目描述 ==\n\n计算输入的字符串中字母\'a’出现的次数（包括大小写）。\n\n== 输入 ==\n\nn个字符，以\'#\'结尾。n<=1000000\n\n== 输出 ==\n\n字母\'a\'出现的次数。\n\n== 样例输入 ==\n\nhuang#\n\n== 样例输出 ==\n\n1\n\n== 样例代码 ==\n<pre>#include<cstdio>\nint main(){\n    char ch; \n    int count = 0;\n    while (ch = getchar(), ch&nbsp;!= \'#\') {\n        if (ch == \'a\' || ch == \'A\') {\n            ++count;\n        }\n    }\n    printf(\"%d\", count);\n    return 0;\n}\n<pre /></pre>','utf-8'),(25,'= 关于问题 =\n\n== 题目描述 ==\n\n计算输入的字符串中字母\'a’出现的次数（包括大小写）。\n\n== 输入 ==\n\nn个字符，以\'#\'结尾。n<=1000000\n\n== 输出 ==\n\n字母\'a\'出现的次数。\n\n== 样例输入 ==\n\nhuang#\n\n== 样例输出 ==\n\n1\n\n== 样例代码 ==\n<pre>#include<cstdio>\nint main(){\n    char ch; \n    int count = 0;\n    while (ch = getchar(), ch&nbsp;!= \'#\') {\n        if (ch == \'a\' || ch == \'A\') {\n            ++count;\n        }\n    }\n    printf(\"%d\", count);\n    return 0;\n}\n</pre>','utf-8'),(26,'= 关于问题 =\n\n== 题目描述 ==\n\n计算输入的字符串中字母\'a’出现的次数（包括大小写）。\n\n== 输入 ==\n\nn个字符，以\'#\'结尾。n<=1000000\n\n== 输出 ==\n\n字母\'a\'出现的次数。\n\n== 样例输入 ==\n\nhuang#\n\n== 样例输出 ==\n\n1\n\n== 样例代码 ==\n<pre>#include<cstdio>\nint main(){\n	char ch; \n	int count = 0;\n	while (ch = getchar(), ch&nbsp;!= \'#\') {\n		if (ch == \'a\' || ch == \'A\') {\n			++count;\n		}\n	}\n	printf(\"%d\", count);\n	return 0;\n}\n</pre>','utf-8'),(27,'= 关于问题 =\n\n== 题目描述 ==\n\n计算输入的字符串中字母\'a’出现的次数（包括大小写）。\n\n== 输入 ==\n\nn个字符，以\'#\'结尾。n<=1000000\n\n== 输出 ==\n\n字母\'a\'出现的次数。\n\n== 样例输入 ==\n\nhuang#\n\n== 样例输出 ==\n\n1\n\n= 关于题解 =\n== 样例代码 ==\n<pre>#include<cstdio>\nint main(){\n	char ch; \n	int count = 0;\n	while (ch = getchar(), ch&nbsp;!= \'#\') {\n		if (ch == \'a\' || ch == \'A\') {\n			++count;\n		}\n	}\n	printf(\"%d\", count);\n	return 0;\n}\n</pre>','utf-8'),(28,'= 关于问题 =\n\n此题目自带题解，不再赘述。\n\n== 问题描述 ==\n\nCalculate a+b\n\n计算 a+b\n\nPlease read the Hint!!!\n\n请注意阅读提示！！！\n\n\n\n== 输入 ==\n\nTwo integer a,b (0<=a,b<=10)\n\n两个整数 a,b﻿&nbsp;(0<=a,b<=10)\n\n<span lang=\"en\" id=\"result_box\" class=\"short_text\">Multiple sets of data，</span>End with EOF\n\n有多组数据输入，以EOF结束\n\n\n\n== 输出 ==\n\nOutput a+b\n\n输出 a+b\n\n\n\n== 样例输入 ==\n\n1 2\n\n2 4\n\n\n\n== 样例输出 ==\n\n3\n\n6\n\n== 提示 ==\n\nQ: Where are the input and the output?\n\nQ:在哪里进行输入输出？<br/><br/>A: Your program shall always&nbsp;<font color=\"red\">read input from stdin (Standard Input) and write output to stdout (Standard Output)</font>. For example, you can use \'scanf\' in C or \'cin\' in C++ to read from stdin, and use \'printf\' in C or \'cout\' in C++ to write to stdout.\n\nA:你的程序应该<span style=\"color: rgb(255, 0, 0);\">总是从标准输入stdin中读取数据，向标准输出stdout中写入数据</span>。比如，在C/C++中，你可以使用scanf/cin来从stdin中读取数据，使用printf/cout来向stdout中写入数据\n\nYou&nbsp;<font color=\"red\">shall not output any extra data</font>&nbsp;to standard output other than that required by the problem, otherwise you will get a \"Wrong Answer\".\n\n<span style=\"color: rgb(255, 0, 0);\">不要输出任何未在输出格式说明中列出的数据</span>，否则无论计算是否正确，你提交的程序都将会被判定为“Wrong Answer”（答案错误）。<br/>User programs are not allowed to open and read from/write to files. You will get a \"Runtime Error\" or a \"Wrong Answer\"if you try to do so.\n\n尝试读写文件的程序是不被系统允许的，如果执意如此，你提交的程序将被判定为“Runtime Error”（运行时错误）或者“Wrong Answer”。\n\n<span style=\"font-size:small;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Here is a sample solution to problem 1000 using C/GCC:</span></span>\n\n使用C编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <stdio.h>\nint main()\n{\n&nbsp;&nbsp;&nbsp; int a,b;\n&nbsp; &nbsp; while(scanf(\"%d&nbsp;%d\",&a, &b)!=EOF)\n    {\n&nbsp; &nbsp;     printf(\"%d\\n\",a+b);\n    }\n&nbsp; &nbsp; return 0;\n}</pre>\nHere is a sample solution to problem 1000 using C++/G++:\n\n使用C++编写的本题例程如下：\n<pre style=\"font-family: Menlo, Monaco, \'Courier New\', monospace; padding: 8.5px; font-size: 12.025px; color: rgb(51, 51, 51); border-top-left-radius: 4px; border-top-right-radius: 4px; border-bottom-right-radius: 4px; border-bottom-left-radius: 4px; margin-top: 0px; margin-bottom: 9px; line-height: 18px; background-color: rgb(245, 245, 245); border: 1px solid rgba(0, 0, 0, 0.14902); white-space: pre-wrap; word-break: break-all; word-wrap: break-word;\">#include <iostream>\nusing namespace std;\nint main()\n{\n    int a,b;\n    while(cin>> a>> b)\n        cout << a+b << endl;\n    return 0;\n}\n</pre>\n<br/><span style=\"color: rgb(255, 0, 0);\">It\'s important that the return type of main() must be int when you use G++/GCC,or you may get compile error.</span>\n\n<span style=\"color: rgb(255, 0, 0);\">注意：使用G++/GCC时，main()函数的返回类型必须为int，否则你提交的程序将被判定为“Compile Error”（编译错误）</span>','utf-8'),(29,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0\n\n= 题解 =\n\n== 分析 ==\n\n这个题难点也就是算日子了。具体算法倒是不复杂，测试数据没有卡时间复杂度，分清楚平年闰年就是了，写对了都AC。我们直接看代码\n\n== 例程 ==\n<blockquote><div><div>#include &lt;stdio.h&gt;</div><div>int mon[]={0,0,31,59,90,120,151,181,212,243,273,304,334};</div><div>int isLeapYear(int y)</div><div>{</div><div>&nbsp; &nbsp; return !(y%100 ? y%4 : y%400);</div><div>}</div><div>int days(int y, int m, int d)</div><div>{</div><div>&nbsp; &nbsp;&nbsp;return d + mon[m] + (isLeapYear(y)&&m>2 ? 1 : 0);</div><div>}</div><div>int main()</div><div>{</div><div>&nbsp; &nbsp;&nbsp;int y1,y2,m1,m2,d1,d2,res;</div><div>&nbsp; &nbsp;&nbsp;while(scanf(\"%d%d%d%d%d%d\", &y1, &m1, &d1, &y2, &m2, &d2)!=EOF)</div><div>&nbsp; &nbsp;&nbsp;{</div><div>&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;res = 0 - days(y1, m1, d1);</div><div>&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;while(y1<y2)</div><div>&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;{</div><div>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;res += isLeapYear(y1++) ? 366 : 365;</div><div>&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;}</div><div>&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;printf(\"%d\\n\", res + days(y2, m2, d2));</div><div>&nbsp; &nbsp;&nbsp;}</div><div>&nbsp; &nbsp;&nbsp;return 0;</div><div>}</div><div><br/></div></div></blockquote><div><br/></div>','utf-8'),(30,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0\n\n= 题解 =\n\n== 分析 ==\n\n这个题难点也就是算日子了。具体算法倒是不复杂，测试数据没有卡时间复杂度，分清楚平年闰年就是了，写对了都AC。我们直接看代码\n\n== 例程 ==\n<pre>#include <stdio.h>\nint mon[]={0,0,31,59,90,120,151,181,212,243,273,304,334};\nint isLeapYear(int y)\n{\n	return&nbsp;!(y%100&nbsp;? y%4&nbsp;: y%400);\n}\nint days(int y, int m, int d)\n{\n	return d + mon[m] + (isLeapYear(y)&&m>2&nbsp;? 1&nbsp;: 0);\n}\nint main()\n{\n	int y1,y2,m1,m2,d1,d2,res;\n	while(scanf(\"%d%d%d%d%d%d\", &y1, &m1, &d1, &y2, &m2, &d2)!=EOF)\n	{\n		res = 0 - days(y1, m1, d1);\n		while(y1<y2)\n		{\n				res += isLeapYear(y1++)&nbsp;? 366&nbsp;: 365;\n		}\n		printf(\"%d\\n\", res + days(y2, m2, d2));\n	}\n	return 0;\n}\n</pre>','utf-8'),(31,'= 整数倒置问题 =\n\n== 题目描述 ==\n\nLB学长有个很怪异的爱好，在他写给基友的信息中，总喜欢把数字倒过来写，比如把123写成321，虽然不知道为什么，但是感觉很厉害的样子～\n\n== 输入 ==\n\n每行一个整数a，(0<=a<=999999999)\n\n== 输出 ==\n\n每行一个倒置过后的整数k&nbsp;&nbsp;&nbsp; 注意：「不忽略开头的零」\n\n== 样例输入 ==\n\n123<br/>237<br/>100\n\n== 样例输出 ==\n\n321<br/>732<br/>001\n\n= 题解 =\n== 分析 ==\n何苦一位一位除来除去，直接用字符串读入，然后倒着打印就是了。\n== 例程 ==\n<pre>\n#include <stdio.h>\nint rev(char p[])\n{\n	return *p ? rev(p++), printf(\"%c\", *p) : 0; \n}\n\nint main()\n{\n	char i[16]={0};\n	while(scanf(\"%s\",i)!=EOF)\n	{\n		rev(i);\n	}\n	return 0;\n}\n\n</pre>','utf-8'),(32,'= 关于问题 =\n\n== 题目描述 ==\n\n求自然数M，N的最大公约数\n\n== 输入 ==\n\n每行2个整数m, n\n\n== 输出 ==\n\n每行一个整整数k, k是m和n的最大公约数\n\n== 样例输入 ==\n\n3 9<br/>6 9<br/>16 64\n\n== 样例输出 ==\n\n3<br/>3<br/>16<br/>提示<br/>遇到了TLE？寻找更有效的方法来解决问题<br/>For C++ Programer<br/>DO NOT USE CIN or COUT\n\n= 题解 =\n== 关于最大公约数算法 ==\n\n这里以欧几里得算法（辗转相除法）为例，给出算法描述：\n<div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">⒈ 若 r 是 a ÷ b 的余数，且r不为0， 则</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">gcd(a,b) = gcd(b,r)</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">⒉ a 和其倍数之最大公因子为 a。</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">另一种写法是：</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">⒈ 令r为a/b所得余数（0≤r<b）</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">若 r= 0，算法结束；b 即为答案。</div><div class=\"para\" style=\"color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 35px; line-height: 25px; font-size: 14px;\">⒉ 互换：置 a←b，b←r，并返回第一步。</div>\n\n== 例程 ==\n<pre>\n#include <stdio.h>\nint gcd(int m, int n)\n{\n	if(m<n)\n	{\n		return gcd(n, m);\n	}\n	if(m % n==0) return n;\n	return gcd(n, m%n);\n}\nint main()\n{\n	int a,b;\n	while(scanf(\"%d%d\", &a, &b)==2)\n	{\n		printf(\"%d\\n\", gcd(a,b));\n	}\n	return 0;\n}	\n</pre>\n或者使用一个更简洁的形式\n<pre>\nint gcd(int m, int n)\n{\n	return m<n ? gcd(n, m) : m%n ? gcd(n, m%n) : n;\n}\n</pre>','utf-8'),(33,'= 关于问题 =\n\n== 问题描述 ==\n\n蒋神的数学功力之深，纵使是他所有的小伙伴们组团来战，犹恐不及十一。\n\n有一天，蒋神心血来潮创造了这样一个数列：\n\nF(n) = 2,&nbsp; 0<=n<4\n\nF(n) =[(n-1)F(n-1) + (n-2)F(n-2)] mod n, n>=4\n\n蒋神的数列有一个奇怪的性质，那就是。。。你猜？\n\n== 输入 ==\n\n每行一个非负整数N, 零<=N<=二十亿\n\n数据有多行\n\n== 输出 ==\n\n每行一个整数K，K=F(N)\n\n== 样例输入 ==\n\n3<br/>4<br/>5<br/>6\n\n== 样例输出 ==\n\n2<br/>2<br/>4<br/>4\n\n= 关于题解 =\n== 分析 ==\n\n这个题...打表吧，数列的规律比较奇葩，F(34)之前至今还没有探测出易于归纳的规律，但是F(34)=F(35)=0，由定义可知，此后所有项都是0.\n其实这题是放过水的，F(34)之前即使是现算都不会超时，因为测试数据除了一组1-35这35个数之外都是过百万的整数...第一个数据的数量级在千万，所以多数人看不到超时，而是直接看到递归过深导致的内存错误...\n\n这里仅给出用于计算非零部分数据的程序\n== 例程 ==\n<pre>\n#include <stdio.h>\n#define N 40\nint p[N]={2,2,2,2};\nint x(int k)\n{\n	if(k>34)\n		return 0;\n	if(p[k] != -1)\n	{\n		return p[k];\n	}\n	if(k>3)\n	{\n		// 这种取余运算是冗余的，因为Fn的前n项中的最大值不可能超过n\n		return p[k] = ((k-1) * (x(k-1) % k) + (k-2) * (x(k-2) % k)) % k;\n	}\n	else return 2;\n}\nint main()\n{\n	int num = 0;\n	for(num=4; num<N; ++num)\n	{\n		p[num] = -1;\n	}\n	while(scanf(\"%d\", &num)!=EOF)\n	{\n		printf(\"%d\\n\", x(num));\n	}\n	return 0;\n}\n</pre>','utf-8'),(34,'= 整数倒置问题 =\n\n== 题目描述 ==\n\nLB学长有个很怪异的爱好，在他写给基友的信息中，总喜欢把数字倒过来写，比如把123写成321，虽然不知道为什么，但是感觉很厉害的样子～\n\n== 输入 ==\n\n每行一个整数a，(0<=a<=999999999)\n\n== 输出 ==\n\n每行一个倒置过后的整数k&nbsp;&nbsp;&nbsp; 注意：「不忽略开头的零」\n\n== 样例输入 ==\n\n123<br/>237<br/>100\n\n== 样例输出 ==\n\n321<br/>732<br/>001\n\n= 题解 =\n== 分析 ==\n何苦一位一位除来除去，直接用字符串读入，然后倒着打印就是了。\n== 例程 ==\n<pre>\n#include <stdio.h>\nint rev(char p[])\n{\n	if(*p)\n	{\n		rev(++p);\n		printf(\"%c\\n\", *p);\n	}\n	else\n	{\n		printf(\"\\n\");\n	}\n	return 0; \n}\n\nint main()\n{\n	char i[16]={0};\n	while(scanf(\"%s\",i)!=EOF)\n	{\n		rev(i);\n	}\n	return 0;\n}\n\n</pre>','utf-8'),(35,'[[蒋神的迷之分级]]\n[[水仙花数]]\n[[素数判定]]\n[[回文数]]\n[[简单排序]]\n[[肃清行动]]\n[[蒋神的迷之走位]]\n[[模式匹配]]\n[[Cifera]]\n[[FeiOS的排序]]\n[[MBP]]\n[[Bell]]\n[[连分数的究极试炼]]\n[[天理昭彰]]\n[[神VS神之1]]\n[[神VS神之2]]\n[[绘制立体图]]\n[[MD5]]','utf-8'),(36,'= 关于 =\n\n2013国庆N题斩是在2013年国庆假期期间放出供大家练习C语言与基本程序设计方法的习题集。\n\n= 题目列表 =\n\n*[[蒋神的迷之分级]]\n*[[水仙花数]]\n*[[素数判定]]\n*[[回文数]]\n*[[简单排序]]\n*[[肃清行动]]\n*[[蒋神的迷之走位]]\n*[[模式匹配]]\n*[[Cifera]]\n*[[FeiOS的排序]]\n*[[MBP]]\n*[[Bell]]\n*[[连分数的究极试炼]]\n*[[天理昭彰]]\n*[[神VS神之1]]\n*[[神VS神之2]]\n*[[绘制立体图]]\n*[[MD5]]','utf-8'),(37,'= 蒋神的迷之分级= \n\n== 题目描述==\nSSSTA算法组的绅士蒋某的考试成绩略差，可是为人嫉妒心极强。为解心头之恨，他决定用独创的方法来标定小伙伴们的考试成绩的等级：\n成绩M>=90分的同学标定为D，80<=M<=89标定为C，60<=M<80标定为B，小于60标定为A\n输入一个成绩，输出等级\n\n==输入 ==\n每行输入一个成绩M, 0<=M<=100\n多组数据，以EOF结束\n== 输出 ==\n每行输出一个等级A或B或C或D\n样例输入\n100\n75\n32<\n== 样例输出 == \nD\nB\nA\n== 提示 ==\n注意阅读蒋神的迷之判定规则！\n= 题解 =\n== 分析 ==\n此题无坑无难点，只消处理好各个临界值附近的分级情况便是了。\n== 例程 ==\n<pre>\n#include <stdio.h>\nint main()\n{\n	int foo;\n	while(scanf(\"%d\", &foo)!=EOF)\n	{\n		printf(\"%c\\n\", (foo >= 80 ? (foo >= 90 ? \'D\' : \'C\') : (foo<60? \'A\' : \'B\')));\n	}\n	return 0;\n}\n</pre>','utf-8'),(38,'= 蒋神的迷之分级 =\n\n== 题目描述 ==\n\nSSSTA算法组的绅士蒋某的考试成绩略差，可是为人嫉妒心极强。为解心头之恨，他决定用独创的方法来标定小伙伴们的考试成绩的等级： 成绩M>=90分的同学标定为D，80<=M<=89标定为C，60<=M<80标定为B，小于60标定为A 输入一个成绩，输出等级\n\n== 输入 ==\n\n每行输入一个成绩M, 0<=M<=100 多组数据，以EOF结束\n\n== 输出 ==\n\n每行输出一个等级A或B或C或D\n\n== 样例输入 ==\n\n100\n\n75\n\n32\n\n== 样例输出 ==\n\nD\n\nB\n\nA\n\n== 提示 ==\n\n注意阅读蒋神的迷之判定规则！\n\n= 题解 =\n\n== 分析 ==\n\n此题无坑无难点，只消处理好各个临界值附近的分级情况便是了。\n\n== 例程 ==\n<pre>#include <stdio.h>\nint main()\n{\n	int foo;\n	while(scanf(\"%d\", &foo)!=EOF)\n	{\n		printf(\"%c\\n\", (foo >= 80&nbsp;? (foo >= 90&nbsp;? \'D\'&nbsp;: \'C\')&nbsp;: (foo<60? \'A\'&nbsp;: \'B\')));\n	}\n	return 0;\n}\n</pre>','utf-8'),(39,'= 水仙花数 =\n\n== 题目描述 ==\n打印出所有的“水仙花数”\n所谓“水仙花数”是指一个三位数，其各位数字立方和等于该数\n\n== 输入 == \n无\n\n== 输出 == \nN行，每行一个水仙花数\n\n== 提示 == \n注意：100不是水仙花数\n\n= 题解 =\n== 分析==\n此题无坑，[[谭书]]和[[刘汝佳]]所著的[[入门经典]]中都选用了类似的题目。\n\n检查101到999之间所有的整数是否满足水仙花数的条件即可。采用数学方法缩小检查范围的努力依然值得赞许，但是即使采用朴素方法，本题所获得的运行时已经足够短。为优化所付出的时间与精力的投入产出比太高。\n== 例程 ==\n<pre>\n#include <stdio.h>\nint tri(int k)\n{\n		return k*k*k;\n}\nint main()\n{\n	int i=100;\n	while(i<1000)\n	{\n		if(i==tri(i%10)+tri(i/100)+tri((i%100)/10))\n		{\n			printf(\"%d\\n\", i);\n		}\n		++i;\n	}\n	return 0;\n}\n\n</pre>','utf-8'),(40,'= 水仙花数 =\n\n== 题目描述 ==\n\n打印出所有的“水仙花数” 所谓“水仙花数”是指一个三位数，其各位数字立方和等于该数\n\n== 输入 ==\n\n无\n\n== 输出 ==\n\nN行，每行一个水仙花数\n\n== 提示 ==\n\n注意：100不是水仙花数\n\n= 题解 =\n\n== 分析 ==\n\n此题无坑，[[谭书]]和[[刘汝佳]]所著的[[入门经典]]中都选用了类似的题目。\n\n检查101到999之间所有的整数是否满足水仙花数的条件即可。采用数学方法缩小检查范围的努力依然值得赞许，但是即使采用朴素方法，本题所获得的运行时已经足够短。为优化所付出的时间与精力的投入产出比太高。\n\n== 例程 ==\n<pre>#include <stdio.h>\nint tri(int k)\n{\n		return k*k*k;\n}\nint main()\n{\n	int i=100;\n	while(i<1000)\n	{\n		if(i==tri(i%10)+tri(i/100)+tri((i%100)/10))\n		{\n			printf(\"%d\\n\", i);\n		}\n		++i;\n	}\n	return 0;\n}\n\n</pre>','utf-8'),(41,'= 素数判定 =\n\n== 题目描述 == \n判断一个数是否是素数，是输出Y，否输出N\n== 输入 ==\n每行输入一个数N（0<=N<=1000000）\n多组数据，以EOF结束\n== 输出 ==\n每行输出一个字符（Y或者N）\n== 样例输入 ==\n2\n3\n4\n5\n== 样例输出 ==\nY\nY\nN\nY\n= 题解 =\n== 分析 ==\n此题难点在于，使用朴素的[[试除法]]会导致时间超限，即使是将试除的上界按[[乔书]]中的第四版算法优化到n的算术平方根，依然不足以在1s之内解决问题——事实上，十万组测试数据中的大多数合数是采用大素数相乘的方法构造的，直接试除意味着全部数据需要逾十亿次除法运算。\n\n设计这道题目的初衷在于希望大家了产生素数的另一个方法，[[素数筛]]法。其原理十分简单：假定所有不小于2的自然数都是素数；如果k是素数，那么nk (n>1) 一定不是素数。从2开始应用这个规则，最终留下的数字必然是素数。\n== 例程 ==\n<pre>\n#include <stdio.h>\n#define N 1000008\nchar table[N]={1,1,0};\nint main()\n{\n	int i,j;\n	for(i=2; i<N; ++i)\n	{\n		if(table[i])\n			continue;\n		for(j=i+i; j<N; j+=i)\n		{\n			table[j]=1;\n		}\n	}\n	while(scanf(\"%d\", &i)!=EOF)\n	{\n		printf(\"%c\\n\", table[i] ? \'N\' : \'Y\');\n	}\n	return 0;\n}\n</pre>','utf-8'),(42,'= 回文数 =\n== 题目描述 ==\n一个正整数从左、右来读都是一样的，则称为回文式数(简称回数)；\n比如101，32123，999都是回数\n输入一个数，判断他是不是回文数，是输出Y，否输出N。\n== 输入 ==\n每行一个正整数N，其中N<231\n\n== 输出 ==\n每行一个字符Y或N\n\n== 样例输入 ==\n101\n32123\n401\n999\n== 样例输出 ==\nY\nY\nN\nY\n= 题解 =\n== 分析 ==\n设计这道题的目的，在于提醒大家执行程序的是机器，不是人。这道题如果真的按题目要求使用整数进行判断，自然能够AC，但是编码过程何其漫长！重新读一下题目，判定一个序列是否为回文序列的唯一依据就是这个序列从是否来回读是一样的，而且题目给定了输入数据的范围，那么我们可以考虑用字符串的形式读入这个整数，然后判定从两端读取的序列是否一样——如果字符串s的长度为n，那么就是要保证对于任意的i<=n-1-i,都有s(i)==s(n-i-1)。这在实现上要比逐项检查更简单。','utf-8'),(43,'= 天理昭彰 =\n\n== 题目描述 ==\n\n看上去人畜无害的蒋神是一只WOWer, 每到期末考试的时节, 必然会在大家各种复习各种求过的时候默默戳开WOW秀优越, 然后怒斩奖学金, 笑傲SSSTA. \n\n为了主持公道, 蒋神的好基友毅然决定设法搞到蒋神的WOW账号+密码! 已知蒋神的注册邮箱是他的企鹅号@ooxx.orz, WOW密码就是邮箱的密码, 密保卡在邮箱的某个角落里... \n\n由于蒋神长期频繁进行某种奇怪的运动, 他的手速早已超神. 纵使好基友进行了长期的潜伏观察，仍然只能确定某些键的相对击键顺序, 从未看清完整的密码序列. 想替天行道吗? 交给你啦~\n\n已知蒋神的密码是一个纯数字序列, 且不包含重复数字, 弱爆了.\n\n== 输入 ==\n\n输入数据有多行，以EOF结束。每行包含一个密码的子序列Mi\n\n数字在每个Mi中的相对位置和在完整密码序列中相对对应数字的位置一致，比如某个子序列为315, \n\n那么完整的密码就一定会是x3xxx1x5xx的形式。\n\n每个子序列Mi均为3个不同的数字，密码中的每个数字均会出现在多个子序列中。输入数据有冗余，必然能够确定唯一密码序列。\n\n== 输出 ==\n\n根据Mi推断出的密码序列\n\n== 样例输入 ==\n\n123\n\n124\n\n534\n\n254\n\n234\n\n== 样例输出 ==\n\n12534\n\n= 题解 =\n\n== 分析 ==\n\n居然有大神谴责我丧心病狂的这个时候就出拓扑排序？！虽然这题目的描述和拓扑排序的描述基情很深，但是...但是这道题只是一个数数的问题啊╮(╯_╰)╭\n\n什么？！你已经拓排了...那你不用往下看了\n\n假定密码序列有5位，那么最高位右边必然有4个数字，次高位右边必然有三个数字...最低位右边是没有一个数字的。这就是数数的基础：我们只要数出出现在每个数字右边的数字数目就是了，而且可以确定真这个频数必然不会重复（频数是数字n的单值函数）。\n\n例程使用了结构体，如果你不太想用这东西呢，就需要依靠一点点数学：密码最长10位，最多有(10*9*8)/(3*2*1)=15*8=120种片段。即使[[Wiki君]]极端丧心病狂地又准备了十万组数据，那么每个数字最多就是出现二十万次(这和上一句好像没什么关系，不过既然已经这样了那就算了)，于是我们开一个二十万的char数组来记录每个频数对应的数字是几（反函数）。\n\n可惜wiki君比较懒，如果你实现了这种方法，那么轻猛戳下面那个栏目的<nowiki>[编辑]</nowiki>连接！\n\n== 例程 ==\n<pre>#include <stdio.h>\n#include <stdlib.h>\ntypedef struct\n{\n    int id;\n    int count;\n} digit;\nchar x[10][10]={0};\ndigit sq[10];\nchar mark[10]={0};\nvoid check(int m, int n)\n{\n    if(x[m][n]==0)\n    {\n        x[m][n]=1;\n        sq[m].count++;\n    }\n}\nint args(const void * a, const void * b)\n{\n    return ((digit*)b)->count - ((digit*)a)->count;\n}\nint main()\n{\n    freopen(\"O.in\", \"r\", stdin);\n    int a,b,c,i;\n    char in[4];\n    for(i=0; i<10; ++i)\n    {\n        sq[i].count = 0;\n        sq[i].id = i;\n    }\n    while(scanf(\"%s\", in)!=EOF)\n    {\n        // 分解数位\n        a = in[0]-\'0\';\n        b = in[1]-\'0\';\n        c = in[2]-\'0\';\n        // 检查各位\n        check(a,b);\n        check(b,c);\n        check(a,c);\n        // 标记已经出现过的数字\n        mark[a]=mark[b]=mark[c]=1;\n    }\n    // 按各个数字右边还存在的数字个数降序排序\n    qsort(sq, 10, sizeof(digit), args);\n    for(i=0; i<10; ++i)\n    {\n        // 忽略未出现过的数字\n        if(!mark[sq[i].id])\n            continue;\n        printf(\"%d\", sq[i].id);\n    }\n    return 0;\n}\n</pre>','utf-8'),(44,'= 连分数的终极试炼 =\n题目太长不抄了\n= 题解 =\n== 分析 ==\n读题读到吐血了吗？那你期末复习怎么办啊~我可是专门把一个超级平易的描述翻译成这个样子的...详见[[Project Eular]] 79。\n这道题直接按题目要求迭代的话有希望手写吗？似乎没有...于是我把最开始的求F(e, 100)改成了求F(e, n)，所谓的n充分小，其实是n不超过41，在这种情况下分子还是可以用一个unsigned long long装下的。那么这道题怎么做？不好意思wiki君和[[用户:Team0xFF|Team0xFF]]（[[用户讨论:Team0xFF|讨论]]）都不会，请自行前往wikipedia查连分数，然后...然后你看见那个超有爱的递推公式了吗？好吧，故事就是这样了。\n\n因为数据范围太小，所以打个表就可以了...注意要动态地打表，不要像[[admin]]这种绅士一样直接初♂始♂化♂一♂个♂数♂组♂\n== 例程 ==\n<pre>\n\n</pre>','utf-8'),(45,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n\n:SSSTA生态\n::*[[基♂房]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(46,'= 整数倒置问题 =\n\n== 题目描述 ==\n\nLB学长有个很怪异的爱好，在他写给基友的信息中，总喜欢把数字倒过来写，比如把123写成321，虽然不知道为什么，但是感觉很厉害的样子～\n\n== 输入 ==\n\n每行一个整数a，(0<=a<=999999999)\n\n== 输出 ==\n\n每行一个倒置过后的整数k&nbsp;&nbsp;&nbsp; 注意：「不忽略开头的零」\n\n== 样例输入 ==\n\n123<br/>237<br/>100\n\n== 样例输出 ==\n\n321<br/>732<br/>001\n\n= 题解 =\n== 分析 ==\n何苦一位一位除来除去，直接用字符串读入，然后倒着打印就是了。\n== 例程 ==\n<pre>#include <stdio.h>\nint rev(char p[])\n{\n	if(*p)\n	{\n		rev(++p);\n		printf(\"%c\\n\", *p);\n	}\n	return 0; \n}\n\nint main()\n{\n	char i[16]={0};\n	while(scanf(\"%s\",i)!=EOF)\n	{\n		rev(i);\n		printf(\"\\n\");\n	}\n	return 0;\n}\n\n</pre>','utf-8'),(47,'= 题解 =','utf-8'),(48,'= 题解 = \n\n题目就不翻译了\n\n题意：给定k,l,求出自然数n，使得kn=l，如果n不存在，输出NO。\n\n思路；已知底数和幂,求指数,每次判断l能被k整除，如果不能，则输出NO，如果可以则更新l的值，l=l/k,再次判断，直到l<=k,如果l==k,则输出循环执行了多少次，即n,否则输出no。\n\n= 例程 =\n\n<pre>\n#include<iostream>\n#include<cstdlib>\n#include<fstream>\n#include<cstdio>\nusing namespace std;\nint main()\n{\n    ifstream in;\n    ofstream out;\n    in.open(\"in.txt\");\n    out.open(\"out.txt\");\n    int k,n,s;\n    while(in>>k>>n)\n    {\n        s=0;\n        while(n>k&&n%k==0)\n        {\n            s++;\n            n=n/k;\n        }\n        if(n!=k)out<<\"NO\"<<endl;\n        else out<<\"YES \"<<s<<endl;\n    }\n    in.close();\n    out.close();\n    return 0;\n}\n</pre>','utf-8'),(49,'= 题解<br/> =\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">双关键字排序，需要对不等式进行化简，容易发现规律，首先按a从小到大排，然后在a相等时b从大到小排即可</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">\'\'\'排序算法\'\'\'<span class=\"Apple-converted-space\">&nbsp;</span>不能使用简单的排序，需要用到快速排序，可以直接调用库函数</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">\'\'\'关于快速排序\'\'\'<span class=\"Apple-converted-space\">&nbsp;</span>请自己查阅资料</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">= 例程 =</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-