adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\"><code style=\"margin-top: 0px;  margin-right: 0px;  margin-bottom: 0px;  margin-left: 0px;  padding-top: 0px;  padding-right: 0px;  padding-bottom: 0px;  padding-left: 0px;  border-style: initial;  border-color: initial;  font-size: 12px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  white-space: pre;  border-top-style: none;  border-right-style: none;  border-bottom-style: none;  border-left-style: none;  background-color: transparent;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px;  border-width: initial;  border-color: initial;  background-image: initial;  background-attachment: initial;  background-origin: initial;  background-clip: initial;  border-width: initial;  border-color: initial;  background-position: initial initial;  background-repeat: initial initial\">#include<stdio.h>\n#include<stdlib.h>\ntypedef struct elem\n{\n    int a,b;\n}elem;\nelem data[1000005];\nint cmp(const void* x,const void* y)\n{\n    if((*(elem *)x).a==(*(elem *)y).a)\n    {\n        return (((elem *)y)->b-((elem *)x)->b);\n    }\n    else return ((elem*)x)->a-((elem*)y)->a;\n}\nint main()\n{\n    freopen(\"test.in\",\"r\",stdin);\n    freopen(\"test.out\",\"w\",stdout);\n    int n,i;\n    scanf(\"%d\",&n);\n    for(i=0;i<n;i++)scanf(\"%d%d\",&(data[i].a),&(data[i].b));\n    qsort(data,n,sizeof(data[0]),cmp);\n    for(i=0;i<n;i++)printf(\"%d %d\\n\",data[i].a,data[i].b);\n    return 0;\n}</code></span></span></pre>\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: