4);  border-left-color: rgb(204, 204, 204);  line-height: 19px;  overflow-x: auto;  overflow-y: auto;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px\">#include<stdlib.h>\ntypedef struct elem\n{\n    int a,b;\n}elem;\nelem data[1000005];\nint cmp(const void* x,const void* y)\n{\n    if((*(elem *)x).a==(*(elem *)y).a)\n    {\n        return (((elem *)y)->b-((elem *)x)->b);\n    }\n    else return ((elem*)x)->a-((elem*)y)->a;\n}\nint main()\n{\n    freopen(\"test.in\",\"r\",stdin);\n    freopen(\"test.out\",\"w\",stdout);\n    int n,i;\n    scanf(\"%d\",&n);\n    for(i=0;i<n;i++)scanf(\"%d%d\",&(data[i].a),&(data[i].b));\n    qsort(data,n,sizeof(data[0]),cmp);\n    for(i=0;i<n;i++)printf(\"%d&nbsp;%d\\n\",data[i].a,data[i].b);\n    return 0;\n}</pre>','utf-8'),(53,'=题解=\n\n根据题意，xy可以互换，不妨假设x>=y<br/><br/>根据a，b的大小关系，可以分为以下几类<br/><br/>1.当b>=2*a时,走直边，一直走到终点就可以<br/><br/>2.当b<2*a时，开始时要走斜边，当走到(x,x)时，需要横向移动，一种是沿着直边，一种沿折线走<br/><br/>*2.1当b&lt;a时，沿着折线走，即(x,x)-&gt;(x+1,y+1)->(x+2,y)，假设目标在(x+1,y)，那么必须要走一次直线<br/><br/>*2.2a<=b<2/a时，直接沿着直线走\n\n\n\n=例程=\n<pre style=\"margin-top: 15px;  margin-right: 0px;  margin-bottom: 15px;  margin-left: 0px;  padding-top: 6px;  padding-right: 10px;  padding-bottom: 6px;  padding-left: 10px;  border-top-width: 1px;  border-right-width: 1px;  border-bottom-width: 1px;  border-left-width: 1px;  border-style: initial;  border-color: initial;  font-size: 13px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  background-color: rgb(248, 248, 248);  border-top-style: solid;  border-right-style: solid;  border-bottom-style: solid;  border-left-style: solid;  border-top-color: rgb(204, 204, 204);  border-right-color: rgb(204, 204, 204);  border-bottom-color: rgb(204, 204, 204);  border-left-color: rgb(204, 204, 204);  line-height: 19px;  overflow-x: auto;  overflow-y: auto;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px\"><span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\"><code style=\"margin-top: 0px;  margin-right: 0px;  margin-bottom: 0px;  margin-left: 0px;  padding-top: 0px;  padding-right: 0px;  padding-bottom: 0px;  padding-left: 0px;  border-style: initial;  border-color: initial;  font-size: 12px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  white-space: pre;  border-top-style: none;  border-right-style: none;  border-bottom-style: none;  border-left-style: none;  background-color: transparent;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px;  border-width: initial;  border-color: initial;  background-image: initial;  background-attachment: initial;  background-origin: initial;  background-clip: initial;  border-width: initial;  border-color: initial;  background-position: initial initial;  background-repeat: initial initial\">#include<stdio.h>\n#include<stdlib.h>\nint min(int u,int v)\n{\n    return u<v?u:v;\n}\nint main()\n{\n    freopen(\"test.in\",\"r\",stdin);\n    freopen(\"test.out\",\"w\",stdout);\n    int x,y,a,b,tmp,ans;\n    while(scanf(\"%d%d%d%d\",&x,&y,&a,&b)!=EOF)\n    {\n        if (b<a)\n        {\n            ans=min(x,y)*b;\n            tmp=abs(x-y);\n            if (tmp%2==0)ans+=tmp*b;\n            else ans+=(tmp-1)*b+a;\n        }\n        else if (b<2*a)\n        {\n            ans=min(x,y)*b;\n            tmp=abs(x-y);\n            ans+=tmp*a;\n        }\n        else\n        {\n           ans=(x+y)*a;\n        }\n        printf(\"%d\\n\",ans);\n    }\n    return 0;\n}</code></span></span></pre>','utf-8'),(54,'= 题解 =\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">关于bell数，可以看下方的链接</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">[http://zh.wikipedia.org/wiki/%E8%B4%9D%E5%B0%94%E6%95%B0 Bell数]</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">我们使用贝尔三角形来计算这个问题，由于只会问1-1000个bell数，所以我们提前计算好所有1000个bell数，直接输出即可，否则每次都计算会超时</span></span>\n\n\n\n= 例程 =\n<pre style=\"margin-top: 15px;  margin-right: 0px;  margin-bottom: 15px;  margin-left: 0px;  padding-top: 6px;  padding-right: 10px;  padding-bottom: 6px;  padding-left: 10px;  border-top-width: 1px;  border-right-width: 1px;  border-bottom-width: 1px;  border-left-width: 1px;  border-style: initial;  border-color: initial;  font-size: 13px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  background-color: rgb(248, 248, 248);  border-top-style: solid;  border-right-style: solid;  border-bottom-style: solid;  border-left-style: solid;  border-top-color: rgb(204, 204, 204);  border-right-color: rgb(204, 204, 204);  border-bottom-color: rgb(204, 204, 204);  border-left-color: rgb(204, 204, 204);  line-height: 19px;  overflow-x: auto;  overflow-y: auto;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px\"><span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\"><code style=\"margin-top: 0px;  margin-right: 0px;  margin-bottom: 0px;  margin-left: 0px;  padding-top: 0px;  padding-right: 0px;  padding-bottom: 0px;  padding-left: 0px;  border-style: initial;  border-color: initial;  font-size: 12px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  white-space: pre;  border-top-style: none;  border-right-style: none;  border-bottom-style: none;  border-left-style: none;  background-color: transparent;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px;  border-width: initial;  border-color: initial;  background-image: initial;  background-attachment: initial;  background-origin: initial;  background-clip: initial;  border-width: initial;  border-color: initial;  background-position: initial initial;  background-repeat: initial initial\">#include<iostream>\n#include<cstdio>\nusing namespace std;\nint bell[1002][1002];\nint main()\n{\n    freopen(\"test.in\",\"r\",stdin);\n    freopen(\"out.out\",\"w\",stdout);\n    bell[0][0]=1;\n    for(int i=1;i<1000;i++)\n    {\n        bell[i][0]=bell[i-1][i-1];\n        for(int j=1;j<=i;j++)bell[i][j]=(bell[i][j-1]+bell[i-1][j-1]100000007;\n    }\n    int n;\n    while(cin>>n)\n    {\n        cout<<bell[n][0]<<endl;\n    }\n    return 0;\n}</code></span></span></pre>','utf-8'),(55,'= 题解 =\n\n<span class=\"Apple-style-span\" style=\"border-collapse: s