_t</code> <code class=\"c plain\">src_len = </code><code class=\"c functions bold\">strlen</code><code class=\"c plain\">(src);</code></div><div class=\"line number183 index182 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c plain\">MD5(dest, src, src_len);</code></div><div class=\"line number184 index183 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[0]);</code></div><div class=\"line number185 index184 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[1]);</code></div><div class=\"line number186 index185 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[2]);</code></div><div class=\"line number187 index186 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[3]);</code></div><div class=\"line number188 index187 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[4]);</code></div><div class=\"line number189 index188 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[5]);</code></div><div class=\"line number190 index189 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[6]);</code></div><div class=\"line number191 index190 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[7]);</code></div><div class=\"line number192 index191 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[8]);</code></div><div class=\"line number193 index192 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[9]);</code></div><div class=\"line number194 index193 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[10]);</code></div><div class=\"line number195 index194 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[11]);</code></div><div class=\"line number196 index195 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[12]);</code></div><div class=\"line number197 index196 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[13]);</code></div><div class=\"line number198 index197 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\"</code><code class=\"c plain\">, dest[14]);</code></div><div class=\"line number199 index198 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c functions bold\">printf</code><code class=\"c plain\">(</code><code class=\"c string\">\"%02x\\n\"</code><code class=\"c plain\">, dest[15]);</code></div><div class=\"line number200 index199 alt1\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c plain\">}</code></div><div class=\"line number201 index200 alt2\"><code class=\"c spaces\">&nbsp;&nbsp;&nbsp;&nbsp;</code><code class=\"c keyword bold\">return</code> <code class=\"c plain\">0;</code></div><div class=\"line number202 index201 alt1\"><code class=\"c plain\">}</code><br/></div>\n&lt;/pre&gt;','utf-8'),(58,'= 题解 =\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">关于MD5的计算，可以看下方的链接</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">[http://zh.wikipedia.org/wiki/MD5 MD5]</span></span>\n\n= 例程<br/> =\n\n\n<pre>\n#include <cstdio>\n#include <cstddef>\n#include <cstdlib>\n#include <cstring>\n \ntypedef unsigned char BYTE;\ntypedef unsigned int DWORD;\ntypedef unsigned long long QWORD;\n \nenum StatusType { normal, no_length, add_length };\n \nstatic size_t const BIT_PER_BYTE     = 8;\nstatic size_t const BIT_PER_DWORD    = 32;\nstatic size_t const BIT_PER_TURN     = 512;\nstatic size_t const BIT_PER_RESULT   = 128;\nstatic size_t const BYTE_PER_DWORD   = BIT_PER_DWORD  / BIT_PER_BYTE;\nstatic size_t const BYTE_PER_TURN    = BIT_PER_TURN   / BIT_PER_BYTE;\nstatic size_t const BYTE_PER_RESULT  = BIT_PER_RESULT / BIT_PER_BYTE;\nstatic size_t const DWORD_PER_TURN   = BIT_PER_TURN   / BIT_PER_DWORD;\nstatic size_t const DWORD_PER_RESULT = BIT_PER_RESULT / BIT_PER_DWORD;\n \nstatic size_t const DEST_INDEX_MASK = 0xF;\nstatic DWORD const BYTE_MASK = 0xFF;\nstatic DWORD const DWORD_MASK = 0xFFFFFFFF;\n \nstatic size_t const SRCLEN = 200 + 0xF;\nstatic size_t const RESLEN = 128 + 0xF;\n \nDWORD const K[] = {\n    0XD76AA478, 0XE8C7B756, 0X242070DB, 0XC1BDCEEE,\n    0XF57C0FAF, 0X4787C62A, 0XA8304613, 0XFD469501,\n    0X698098D8, 0X8B44F7AF, 0XFFFF5BB1, 0X895CD7BE,\n    0X6B901122, 0XFD987193, 0XA679438E, 0X49B40821,\n    0XF61E2562, 0XC040B340, 0X265E5A51, 0XE9B6C7AA,\n    0XD62F105D, 0X02441453, 0XD8A1E681, 0XE7D3FBC8,\n    0X21E1CDE6, 0XC33707D6, 0XF4D50D87, 0X455A14ED,\n    0XA9E3E905, 0XFCEFA3F8, 0X676F02D9, 0X8D2A4C8A,\n    0XFFFA3942, 0X8771F681, 0X6D9D6122, 0XFDE5380C,\n    0XA4BEEA44, 0X4BDECFA9, 0XF6BB4B60, 0XBEBFBC70,\n    0X289B7EC6, 0XEAA127FA, 0XD4EF3085, 0X04881D05,\n    0XD9D4D039, 0XE6DB99E5, 0X1FA27CF8, 0XC4AC5665,\n    0XF4292244, 0X432AFF97, 0XAB9423A7, 0XFC93A039,\n    0X655B59C3, 0X8F0CCC92, 0XFFEFF47D, 0X85845DD1,\n    0X6FA87E4F, 0XFE2CE6E0, 0XA3014314, 0X4E0811A1,\n    0XF7537E82, 0XBD3AF235, 0X2AD7D2BB, 0XEB86D391\n};\n \ninline DWORD lrotate(DWORD x, size_t s) { return (x<<s) | (x>>(BIT_PER_DWORD-s)); }\ninline DWORD F(DWORD x, DWORD y, DWORD z) { return (x & y) | (~x & z); }\ninline DWORD G(DWORD x, DWORD y, DWORD z) { return (x & z) | (y & ~z); }\ninline DWORD H(DWORD x, DWORD y, DWORD z) { return x ^ y ^ z; }\ninline DWORD I(DWORD x, DWORD y, DWORD z) { return y ^ (x | ~z); }\ninline size_t min_val(size_t x, size_t y) { return x < y ? x : y; }\n \nchar src[SRCLEN];\nBYTE dest[BYTE_PER_RESULT];\n \ninline void BYTE2DWORD(DWORD dest[DWORD_PER_TURN], BYTE const src[BYTE_PER_TURN]) {\n    for (size_t i=0, j=0; i < DWORD_PER_TURN; ++i, j+=BYTE_PER_DWORD) {\n        dest[i] = (DWORD(src[j+3]) << (3 * BIT_PER_BYTE)) |\n                  (DWORD(src[j+2]) << (2 * BIT_PER_BYTE)) |\n                  (DWORD(src[j+1]) <<      BIT_PER_BYTE)  |\n                   DWORD(src[j]);\n    }\n}\n \ninline void DWORD2BYTE(BYTE dest[BYTE_PER_RESULT], DWORD const src[DWORD_PER_RESULT]) {\n    for(size_t i=0; i<BYTE_PER_RESULT; ) {\n        DWORD v = *src++;\n        dest[i++] = BYTE(v & BYTE_MASK); v >>= BIT_PER_BYTE;\n        dest[i++] = BYTE(v & BYTE_MASK); v >>= BIT_PER_BYTE;\n        dest[i++] = BYTE(v & BYTE_MASK); v >>= BIT_PER_BYTE;\n        dest[i++] = BYTE(v & BYTE_MASK);\n    }\n}\n \nStatusType feed(DWORD dest[DWORD_PER_TURN], char const * const source, size_t const source_byte, size_t const length, StatusType & last_status) {\n    StatusType status = normal;\n    BYTE buff[BYTE_PER_TURN];\n    if (source_byte < BYTE_PER_TURN) {\n        memcpy(buff, source, source_byte);\n        memset(buff+source_byte, 0, BYTE_PER_TURN-source_byte);\n        if (last_status == normal) {\n            buff[source_byte] = \'\\200\';\n        }\n        status = no_length;\n    } else {\n        memcpy(buff, source, BYTE_PER_TURN);\n    }\n \n    BYTE2DWORD(dest, buff);\n \n    if (source_byte <= BYTE_PER_TURN - 9) {\n        status = add_length;\n        dest[14] = DWORD(length<<3 & DWORD_MASK);\n        dest[15] = DWORD(length>>(BIT_PER_DWORD-3) & 0x7);\n    }\n    return status;\n}\n \nvoid process(DWORD dest[DWORD_PER_RESULT], DWORD src[DWORD_PER_TURN]) {\n    for (size_t i=0; i<DWORD_PER_RESULT*DWORD_PER_RESULT; i+=DWORD_PER_RESULT) {\n        dest[0]=dest[0]+F(dest[1],dest[2],dest[3])+src[i  ]+K[i  ];dest[0]=lrotate(dest[0], 7);dest[0]+=dest[1];\n        dest[3]=dest[3]+F(dest[0],dest[1],dest[2])+src[i+1]+K[i+1];dest[3]=lrotate(dest[3],12);dest[3]+=dest[0];\n        dest[2]=dest[2]+F(dest[3],dest[0],dest[1])+src[i+2]+K[i+2];dest[2]=lrotate(dest[2],17);dest[2]+=dest[3];\n        dest[1]=dest[1]+F(dest[2],dest[3],dest[0])+src[i+3]+K[i+3];dest[1]=lrotate(dest[1],22);dest[1]+=dest[2];\n    }\n    for (size_t i=0; i<DWORD_PER_RESULT*DWORD_PER_RESULT; i+=DWORD_PER_RESULT) {\n        dest[0]=dest[0]+G(dest[1],dest[2],dest[3])+src[(5* i   +1)&DEST_INDEX_MASK]+K[(i-1)+17];dest[0]=lrotate(dest[0], 5);dest[0]+=dest[1];\n        dest[3]=dest[3]+G(dest[0],dest[1],dest[2])+src[(5*(i+1)+1)&DEST_INDEX_MASK]+K[ i   +17];dest[3]=lrotate(dest[3], 9);dest[3]+=dest[0];\n        dest[2]=dest[2]+G(dest[3],dest[0],dest[1])+src[(5*(i+2)+1)&DEST_INDEX_MASK]+K[(i+1)+17];dest[2]=lrotate(dest[2],14);dest[2]+=dest[3];\n        dest[1]=dest[1]+G(dest[2],dest[3],dest[0])+src[(5*(i+3)+1)&DEST_INDEX_MASK]+K[(i+2)+17];dest[1]=lrotate(dest[1],20);dest[1]+=dest[2];\n    }\n    for (size_t i=0; i<DWORD_PER_RESULT*DWORD_PER_RESULT; i+=DWORD_PER_RESULT) {\n        dest[0]=dest[0]+H(dest[1],dest[2],dest[3])+src[(3* i   +5)&DEST_INDEX_MASK]+K[(i-1)+33];dest[0]=lrotate(dest[0], 4);dest[0]+=dest[1];\n        dest[3]=dest[3]+H(dest[0],dest[1],dest[2])+src[(3*(i+1)+5)&DEST_INDEX_MASK]+K[ i   +33];dest[3]=lrotate(dest[3],11);dest[3]+=dest[0];\n        dest[2]=dest[2]+H(dest[3],dest[0],dest[1])+src[(3*(i+2)+5)&DEST_INDEX_MASK]+K[(i+1)+33];dest[2]=lrotate(dest[2],16);dest[2]+=dest[3];\n        dest[1]=dest[1]+H(dest[2],dest[3],dest[0])+src[(3*(i+3)+5)&DEST_INDEX_MASK]+K[(i+2)+33];dest[1]=lrotate(dest[1],23);dest[1]+=dest[2];\n    }\n    for (size_t i=0; i<DWORD_PER_RESULT*DWORD_PER_RESULT; i+=DWORD_PER_RESULT) {\n        dest[0]=dest[0]+I(dest[1],dest[2],dest[3])+src[(7* i   )&DEST_INDEX_MASK]+K[(i-1)+49];dest[0]=lrotate(dest[0], 6);dest[0]+=dest[1];\n        dest[3]=dest[3]+I(dest[0],dest[1],dest[2])+src[(7*(i+1))&DEST_INDEX_MASK]+K[ i   +49];dest[3]=lrotate(dest[3],10);dest[3]+=dest[0];\n        dest[2]=dest[2]+I(dest[3],dest[0],dest[1])+src[(7*(i+2))&DEST_INDEX_MASK]+K[(i+1)+49];dest[2]=lrotate(dest[2],15);dest[2]+=dest[3];\n        dest[1]=dest[1]+I(dest[2],dest[3],dest[0])+src[(7*(i+3))&DEST_INDEX_MASK]+K[(i+2)+49];dest[1]=lrotate(dest[1],21);dest[1]+=dest[2];\n    }\n}\n \nvoid MD5(BYTE dest[BYTE_PER_RESULT], char const * const src, size_t const src_len) {\n    DWORD result[DWORD_PER_RESULT];\n    {\n        result[0] = 0x67452301;\n        result[1] = 0xEFCDAB89;\n        result[2] = 0x98BADCFE;\n        result[3] = 0x10325476;\n    }\n \n    StatusType status = normal;\n    for (size_t si = 0; status != add_length; ) {\n        DWORD buff[DWORD_PER_TURN];\n        size_t byte_num = min_val(BYTE_PER_TURN, src_len-si);\n \n        DWORD last[BYTE_PER_RESULT];\n \n        {\n            last[0] = result[0];\n            last[1] = result[1];\n            last[2] = result[2];\n            last[3] = result[3];\n        }\n \n        status = feed(buff, src+si, byte_num, src_len, status);\n \n        process(result, buff);\n \n        {\n            result[0] += last[0];\n            result[1] += last[1];\n            result[2] += last[2];\n            result[3] += last[3];\n        }\n \n        si += byte_num;\n    }\n \n    DWORD2BYTE(dest, result);\n}\n \ninline DWORD rev(DWORD v) {\n    DWORD r = v;\n    size_t s = BIT_PER_DWORD - 1;\n    for (v >>= 1; v; v >>= 1) {\n        r <<= 1;\n        r |= v & 1;\n        s--;\n    }\n    return r << s;\n}\n \n \nint main() {\n    for (; gets(src) != NULL;) {\n        size_t src_len = strlen(src);\n        MD5(dest, src, src_len);\n        printf(\"%02x\", dest[0]);\n        printf(\"%02x\", dest[1]);\n        printf(\"%02x\", dest[2]);\n        printf(\"%02x\", dest[3]);\n        printf(\"%02x\", dest[4]);\n        printf(\"%02x\", dest[5]);\n        printf(\"%02x\", dest[6]);\n        printf(\"%02x\", dest[7]);\n        printf(\"%02x\", dest[8]);\n        printf(\"%02x\", dest[9]);\n        printf(\"%02x\", dest[10]);\n        printf(\"%02x\", dest[11]);\n        printf(\"%02x\", dest[12]);\n        printf(\"%02x\", dest[13]);\n        printf(\"%02x\", dest[14]);\n        printf(\"%02x\\n\", dest[15]);\n    }\n    return 0;\n}\n</pre>','utf-8'),(59,'= 天理昭彰 =\n\n== 题目描述 ==\n\n看上去人畜无害的蒋神是一只WOWer, 每到期末考试的时节, 必然会在大家各种复习各种求过的时候默默戳开WOW秀优越, 然后怒斩奖学金, 笑傲SSSTA.\n\n为了主持公道, 蒋神的好基友毅然决定设法搞到蒋神的WOW账号+密码! 已知蒋神的注册邮箱是他的企鹅号@ooxx.orz, WOW密码就是邮箱的密码, 密保卡在邮箱的某个角落里...\n\n由于蒋神长期频繁进行某种奇怪的运动, 他的手速早已超神. 纵使好基友进行了长期的潜伏观察，仍然只能确定某些键的相对击键顺序, 从未看清完整的密码序列. 想替天行道吗? 交给你啦~\n\n已知蒋神的密码是一个纯数字序列, 且不包含重复数字, 弱爆了.\n\n== 输入 ==\n\n输入数据有多行，以EOF结束。每行包含一个密码的子序列Mi\n\n数字在每个Mi中的相对位置和在完整密码序列中相对对应数字的位置一致，比如某个子序列为315,\n\n那么完整的密码就一定会是x3xxx1x5xx的形式。\n\n每个子序列Mi均为3个不同的数字，密码中的每个数字均会出现在多个子序列中。输入数据有冗余，必然能够确定唯一密码序列。\n\n== 输出 ==\n\n根据Mi推断出的密码序列\n\n== 样例输入 ==\n\n123\n\n124\n\n534\n\n254\n\n234\n\n== 样例输出 ==\n\n12534\n\n= 题解 =\n\n== 分析 ==\n\n居然有大神谴责我丧心病狂的这个时候就出拓扑排序？！虽然这题目的描述和拓扑排序的描述基情很深，但是...但是这道题只是一个数数的问题啊╮(╯_╰)╭\n\n什么？！你已经拓排了...那你不用往下看了\n\n假定密码序列有5位，那么最高位右边必然有4个数字，次高位右边必然有三个数字...最低位右边是没有一个数字的。这就是数数的基础：我们只要数出出现在每个数字右边的数字数目就是了，而且可以确定真这个频数必然不会重复（频数是数字n的单值函数）。\n\n例程使用了结构体，如果你不太想用这东西呢，就需要依靠一点点数学：密码最长10位，最多有(10*9*8)/(3*2*1)=15*8=120种片段。即使[[Wiki君]]极端丧心病狂地又准备了十万组数据，那么每个数字最多就是出现二十万次(这和上一句好像没什么关系，不过既然已经这样了那就算了)，于是我们开一个二十万的char数组来记录每个频数对应的数字是几（反函数）。\n\n可惜wiki君比较懒，如果你实现了这种方法，那么轻猛戳下面那个栏目的<nowiki>[编辑]</nowiki>连接！\n\n== 例程 ==\n<pre>#include <stdio.h>\n#include <stdlib.h>\ntypedef struct\n{\n    int id;\n    int count;\n} digit;\nchar x[10][10]={0};\ndigit sq[10];\nchar mark[10]={0};\nvoid check(int m, int n)\n{\n    if(x[m][n]==0)\n    {\n        x[m][n]=1;\n        sq[m].count++;\n    }\n}\nint args(const void * a, const void * b)\n{\n    return ((digit*)b)->count - ((digit*)a)->count;\n}\nint main()\n{\n    freopen(\"O.in\", \"r\", stdin);\n    int a,b,c,i;\n    char in[4];\n    for(i=0; i<10; ++i)\n    {\n        sq[i].count = 0;\n        sq[i].id = i;\n    }\n    while(scanf(\"%s\", in)!=EOF)\n    {\n        // 分解数位\n        a = in[0]-\'0\';\n        b = in[1]-\'0\';\n        c = in[2]-\'0\';\n        // 检查各位\n        check(a,b);\n        check(b,c);\n        check(a,c);\n        // 标记已经出现过的数字\n        mark[a]=mark[b]=mark[c]=1;\n    }\n    // 按各个数字右边还存在的数字个数降序排序\n    qsort(sq, 10, sizeof(digit), args);\n    for(i=0; i<10; ++i)\n    {\n        // 忽略未出现过的数字\n        if(!mark[sq[i].id])\n            continue;\n        printf(\"%d\", sq[i].id);\n    }\n    return 0;\n}\n</pre>\n== 这么明显的拓扑排序 ==\n<pre>#include <cstdio>\n\nint const MAXN = 10;\n\nchar str[4];\nbool graph[MAXN][MAXN];\nbool appeared[MAXN];\n\nint main() {\n	for(&nbsp;;scanf(\"%s\", str)&nbsp;!= EOF; ) {\n		graph[str[1]-\'0\'][str[2]-\'0\'] = graph[str[0]-\'0\'][str[1]-\'0\'] = appeared[str[2]-\'0\'] = appeared[str[1]-\'0\'] = appeared[str[0]-\'0\'] = true;\n	}\n     \n	int n;\n	for (int i=0; i<MAXN; ++i) {\n		if (appeared[i]) {\n			++n;\n		}\n	}\n \n	for (int i=0; i<n; ++i) {\n		int j;\n		for (j=0; j<MAXN; ++j) {\n			if (appeared[j]) {\n				bool flag = true;\n				for (int k=0; flag && k<MAXN; ++k) {\n					flag =&nbsp;!graph[k][j];\n				}\n				if (flag) {\n					break;\n				}\n			}\n		}\n		for (int k=0; k<MAXN; ++k) {\n			graph[j][k] = false;\n		}\n		appeared[j] = false;\n		printf(\"%d\", j);\n	}\n	putchar(\'\\n\');\n	return 0;\n}\n</pre>','utf-8'),(60,'= 神VS神之1 =\n\n== 题目描述 ==\n\n大蒋神和大飞神要一决胜负\n\n他们用剪刀锤子布的方式比试\n\n请你编程来判断谁赢了\n\n== 输入 ==\n\n多组数据\n\nS表示剪刀\n\nR表示石头\n\nP表示布\n\n先后输入大蒋神和大飞神出的结果\n\nEOF结尾\n\n== 输出 ==\n\n对每组数据\n\n大蒋神获胜输出\"J\"\n\n大飞神获胜输出\"F\"\n\n平局输出\"W\"\n\n== 样例输入 ==\n\nR S\n\nS R\n\nP P\n\n== 样例输出 ==\n\nJ\n\nF\n\nW\n\n= 题解 =\n\n== 分析 ==\n\n看起来不难是吧。\n\n但是，\n\n输入输出的处理上坑了不少人。\n\n正确的姿势是怎样的呢？\n<pre>scanf(\"%c&nbsp;%c\\n\", &a, &b)\n</pre>\n或\n<pre>scanf(\"%s&nbsp;%s\", &a, &b)\n</pre>\n不过呢，当你使用第一种方法并且手动输入时你会惊奇地发现答案错误。\n\n这其中的原因比较复杂，下面会请大飞神讲解\n\n== 大飞神的讲解 ==\n\n大飞神你快来\n\n== 例程 ==\n<pre>#include<cstdio>\nint const JUDGE[3][3]={\n	{1, 2, 0},\n	{0, 1, 2},\n	{2, 0, 1}\n};\nchar const RESULT[4]=\"JWF\";\n\nint magic_hash(char c) {\n	/*\n	 *  same as\n	 *  if (c == \'R\') {\n	 *  	return 0;\n	 *  } else if (c == \'P\') {\n	 *  	return 1;\n	 *  } else if (c == \'S\') {\n	 *  	return 2;\n	 *  } else {\n	 *  	return \"Sorry, I dont\'t know.\";\n	 *  }\n	 */\n	return c%2 + c%3 - 1;\n}\n\nint main(){\n	for (char a, b; scanf(\"%c&nbsp;%c\\n\",&a,&b)&nbsp;!= EOF; ) {\n		printf(\"%c\\n\", RESULT[JUDGE[magic_hash(a)][magic_hash(b)]]);\n	}\n	return 0;\n}\n</pre>','utf-8'),(61,'= 神VS神之2 =\n\n== 题目描述 ==\n\n大飞神和大蒋神开始了第二轮比试（搅基）\n\n这次的规则是这样：\n\n给定两个正整数M和N，从大飞神开始，从其中较大的一个数，减去较小的数的正整数倍，当然，得到的数不能小于0。然后是大蒋神，对刚才得到的数，和M，N中较小的那个数，再进行同样的操作……直到一个人得到了0，他就取得了胜利。\n\n大飞神和大蒋神都是大神，他们能完美地操作，谁会取得胜利呢？\n\n== 输入 ==\n\n第一行为测试数据的组数C。下面有C行，每行为一组数据，包含两个正整数M, N。\n\n== 输出 ==\n\n对每组输入数据输出一行\n\n大飞神胜利时输出“Orz God Fei”\n\n大蒋神胜利时输出“Orz God Jiang”\n\n== 样例输入 ==\n\n2\n\n25 7\n\n24 15\n\n== 样例输出 ==\n\nOrz God Fei\n\nOrz God Jiang\n\n= 题解 =\n\n== 分析 ==\n\n这是一个有关博弈论的问题。\n\n任意局面的状态只有两种可能：\n\n胜态：有必胜策略\n\n败态：没有必胜策略\n\n对于胜状态，无论如何走，都不可能走到另一个胜状态\n\n对于负状态，至少存在一种走法可以走到胜状态\n\n由于m和n是对称的，不妨设 m≥n\n\n如果m div n < 2，则只能将(m, n)变为(n, m-n)，(n, m-n)为胜态时(m, n)为败态，反之亦然\n\n如果m div n ≥ 2，则至少存在两种走法:将(m, n)变为(n, m mod n)或(n+(m mod n), n)\n\n若(n, m mod n)或(n+(m mod n), n)其中一个为败态，则(m, n)必胜\n\n由于(n+(m mod n), n)可以走到(n, m mod n)，则(n, m mod n)和(n+(m mod n), n)不能同时为胜态\n\n于是(m, n)为胜态\n\n综上，令f(m, n)表示(m, n)是否必胜\n\nm div n &lt; 2 =&gt; f(m, n) =&nbsp;!(n, m-n)\n\nm div n > 1 => f(m, n) = T\n\n== 例程 ==\n<pre>#include<cstdio>\n\nbool f(int m, int n) {\n	return n==0&nbsp;? false&nbsp;: m >= 2 * n&nbsp;? true&nbsp;:&nbsp;!f(n, m - n);\n}\n\nint main() {\n	int C;\n	scanf(\"%d\",&C);\n	for (;C--;) {\n		int m, n;\n		scanf(\"%d%d\", &m, &n);\n		puts((m < n&nbsp;? f(n, m)&nbsp;: f(m, n))?\"Orz God Fei\":\"Orz God Jiang\");\n	}\n	return 0;\n}\n</pre>','utf-8'),(62,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0\n\n= 题解 =\n\n== 分析 ==\n\n这个题难点也就是算日子了。具体算法倒是不复杂，测试数据没有卡时间复杂度，分清楚平年闰年就是了，写对了都AC。我们直接看代码\n\n== 例程 ==\n<pre>#include <stdio.h>\nint mon[]={0,0,31,59,90,120,151,181,212,243,273,304,334};\nint isLeapYear(int y)\n{\n	return&nbsp;!(y%100&nbsp;? y%4&nbsp;: y%400);\n}\nint days(int y, int m, int d)\n{\n	return d + mon[m] + (isLeapYear(y)&&m>2&nbsp;? 1&nbsp;: 0);\n}\nint main()\n{\n	int y1,y2,m1,m2,d1,d2,res;\n	while(scanf(\"%d%d%d%d%d%d\", &y1, &m1, &d1, &y2, &m2, &d2)!=EOF)\n	{\n		res = 0 - days(y1, m1, d1);\n		while(y1<y2)\n		{\n				res += isLeapYear(y1++)&nbsp;? 366&nbsp;: 365;\n		}\n		printf(\"%d\\n\", res + days(y2, m2, d2));\n	}\n	return 0;\n}\n</pre><pre>#include <cstdio>\nint M[]={0,31,59,90,120,151,181,212,243,273,304,334,365};\nint isleap(int y) {\n    return (y%4==0&&y%100!=0)||y%400==0;\n}\nint days(int y, int m, int d) {\n    return 365*y+y/4-y/100+y/400-isleap(y)+M[m-1]+d+(m>2&&isleap(y));\n}\nint main() {\n    for (int y1,m1,d1,y2,m2,d2;~scanf(\"%d%d%d%d%d%d\",&y1,&m1,&d1,&y2,&m2,&d2);printf(\"%d\\n\",days(y2, m2, d2)-days(y1, m1, d1)));\n}\n</pre>','utf-8'),(63,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0\n\n= 题解 =\n\n== 分析 ==\n\n这个题难点也就是算日子了。具体算法倒是不复杂，测试数据没有卡时间复杂度，分清楚平年闰年就是了，写对了都AC。我们直接看代码\n\n== 例程 ==\n<pre>#include <stdio.h>\nint mon[]={0,0,31,59,90,120,151,181,212,243,273,304,334};\nint isLeapYear(int y)\n{\n	return&nbsp;!(y%100&nbsp;? y%4&nbsp;: y%400);\n}\nint days(int y, int m, int d)\n{\n	return d + mon[m] + (isLeapYear(y)&&m>2&nbsp;? 1&nbsp;: 0);\n}\nint main()\n{\n	int y1,y2,m1,m2,d1,d2,res;\n	while(scanf(\"%d%d%d%d%d%d\", &y1, &m1, &d1, &y2, &m2, &d2)!=EOF)\n	{\n		res = 0 - days(y1, m1, d1);\n		while(y1<y2)\n		{\n				res += isLeapYear(y1++)&nbsp;? 366&nbsp;: 365;\n		}\n		printf(\"%d\\n\", res + days(y2, m2, d2));\n	}\n	return 0;\n}\n</pre><pre>#include <cstdio>\nint M[]={0,31,59,90,120,151,181,212,243,273,304,334,365}; int isleap(int y) {\n	return (y%4==0&&y%100!=0)||y%400==0;\n}\nint days(int y, int m, int d) {\n	return 365*y+y/4-y/100+y/400-isleap(y)+M[m-1]+d+(m>2&&isleap(y));\n}\nint main() {\n	for (int y1,m1,d1,y2,m2,d2;~scanf(\"%d%d%d%d%d%d\",&y1,&m1,&d1,&y2,&m2,&d2);printf(\"%d\\n\",days(y2, m2, d2)-days(y1, m1, d1)));\n}\n</pre>','utf-8'),(64,'= 日期计算问题 =\n\n== 题目描述 ==\n\n计算两给定日期之间相差的天数\n\n== 输入 ==\n\n每行「6个整数」Y1 M1 D1 Y2 M2 D2，分别为两个日期的年月日「输入数据保证：第二个日期一定不早于第一个日期且日期合法，1=<Y<=9999,」\n\n多组数据，以EOF结束\n\n== 输出 ==\n\n每行一个正整数\n\n== 样例输入 ==\n\n2012 12 21 2013 9 24<br/>2013 10 1&nbsp; 2013 10 1\n\n== 样例输出 ==\n\n277<br/>0\n\n= 题解 =\n\n== 分析 ==\n\n这个题难点也就是算日子了。具体算法倒是不复杂，测试数据没有卡时间复杂度，分清楚平年闰年就是了，写对了都AC。我们直接看代码\n\n== 例程 ==\n<pre>#include <stdio.h>\nint mon[]={0,0,31,59,90,120,151,181,212,243,273,304,334};\nint isLeapYear(int y)\n{\n	return&nbsp;!(y%100&nbsp;? y%4&nbsp;: y%400);\n}\nint days(int y, int m, int d)\n{\n	return d + mon[m] + (isLeapYear(y)&&m>2&nbsp;? 1&nbsp;: 0);\n}\nint main()\n{\n	int y1,y2,m1,m2,d1,d2,res;\n	while(scanf(\"%d%d%d%d%d%d\", &y1, &m1, &d1, &y2, &m2, &d2)!=EOF)\n	{\n		res = 0 - days(y1, m1, d1);\n		while(y1<y2)\n		{\n				res += isLeapYear(y1++)&nbsp;? 366&nbsp;: 365;\n		}\n		printf(\"%d\\n\", res + days(y2, m2, d2));\n	}\n	return 0;\n}\n</pre><pre>#include<cstdio>\nint M[]={0,31,59,90,120,151,181,212,243,273,304,334,365};\n\nint isleap(int y) {\n	return (y%4==0&&y%100!=0)||y%400==0;\n}\n\nint days(int y, int m, int d) {\n	return 365*y+y/4-y/100+y/400-isleap(y)+M[m-1]+d+(m>2&&isleap(y));\n}\n\nint main() {\n	for (int y1,m1,d1,y2,m2,d2;~scanf(\"%d%d%d%d%d%d\",&y1,&m1,&d1,&y2,&m2,&d2);printf(\"%d\\n\",days(y2, m2, d2)-days(y1, m1, d1)));\n}\n</pre>','utf-8'),(65,'= 关于题目 =\n\n= 关于题解 =\n\n== 样例代码 ==\n<pre>#include <cstdio>\n\nint const MAX_MAP_SIZE = 100 + 0xF;\nint const MAX_CANVAS_SIZE = MAX_MAP_SIZE * 6;\n\nchar const PROTOTYPE[6][7] = {\n	{\'.\',\'.\',\'+\',\'-\',\'-\',\'-\',\'+\'},\n	{\'.\',\'/\',\' \',\' \',\' \',\'/\',\'|\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\' \',\'|\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\' \',\'+\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\'/\',\'.\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\'.\',\'.\'}\n};\n\nint map[MAX_MAP_SIZE][MAX_MAP_SIZE];\n\nchar canvas[MAX_CANVAS_SIZE][MAX_CANVAS_SIZE];\n\ninline void max_ref(int&a, int b) { if (a<b) { a = b; } }\ninline void min_ref(int&a, int b) { if (a>b) { a = b; } }\n\nvoid draw_cube(int x, int y) {\n	for (int i=0; i<6; ++i) {\n		for (int j=0; j<7; ++j) {\n			if (PROTOTYPE[5-i][j]&nbsp;!= \'.\') {\n				canvas[x+i][y+j] = PROTOTYPE[5-i][j];\n			}\n		}\n	}\n}\n\nvoid draw_stack(int x, int y, int n) {\n	for (int i=0, tx=x; i<n; ++i, tx+=3) {\n		draw_cube(tx,y);\n	}\n}\n\nvoid draw_row(int x, int y, int r, int n){\n	for (int i=0, ty=y; i<n; ++i, ty+=4) {\n		draw_stack(x, ty, map[r][i]);\n	}\n}\n\nbool search(int r) {\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		if (canvas[r][i]&nbsp;!= \'.\') {\n			return false;\n		}\n	}\n	return true;\n}\nint main() {\n	int m=0,n=0;\n	scanf(\"%d%d\", &m, &n);\n\n	for (int i=0; i<m; ++i) {\n		for (int j=0; j<n; ++j) {\n			scanf(\"%d\", &map[i][j]);\n		}\n	}\n\n\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		for (int j=0; j<MAX_CANVAS_SIZE; ++j) {\n			canvas[i][j]=\'.\';\n		}\n	}\n\n	int x0=2*m-2, y0=2*m-2;\n\n\n	for (int i=0; i<m; x0-=2, y0-=2, ++i) {\n		draw_row(x0, y0, i, n);\n	}\n\n	int mxl = 0, mxh = MAX_CANVAS_SIZE - 1;\n	int myl = MAX_CANVAS_SIZE - 1, myh = 0;\n\n	while(search(mxl)) {\n		++mxl;\n	}\n\n    while(search(mxh)) {\n		--mxh;\n    }\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=0; j<myl; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				min_ref(myl,j);\n			}\n		}\n	}\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=myh; j<MAX_CANVAS_SIZE; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				max_ref(myh,j);\n			}\n		}\n	}\n\n	for (int i=mxh; i>=mxl; --i) {\n		for (int j=myl; j<=myh; ++j) {\n			putchar(canvas[i][j]);\n		}\n		putchar(\'\\n\');\n	}\n}\n\n</pre>','utf-8'),(66,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n\n:SSSTA生态\n::*实验室\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(67,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n\n:SSSTA生态\n::*[[实验室]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(68,'= 回文数 =\n== 题目描述 ==\n一个正整数从左、右来读都是一样的，则称为回文式数(简称回数)；\n比如101，32123，999都是回数\n输入一个数，判断他是不是回文数，是输出Y，否输出N。\n== 输入 ==\n\n每行一个正整数N，其中N<2<sup>31</sup>\n\n== 输出 ==\n每行一个字符Y或N\n\n== 样例输入 ==\n101\n32123\n401\n999\n== 样例输出 ==\nY\nY\nN\nY\n= 题解 =\n== 分析 ==\n设计这道题的目的，在于提醒大家执行程序的是机器，不是人。这道题如果真的按题目要求使用整数进行判断，自然能够AC，但是编码过程何其漫长！重新读一下题目，判定一个序列是否为回文序列的唯一依据就是这个序列从是否来回读是一样的，而且题目给定了输入数据的范围，那么我们可以考虑用字符串的形式读入这个整数，然后判定从两端读取的序列是否一样——如果字符串s的长度为n，那么就是要保证对于任意的i<=n-1-i,都有s(i)==s(n-i-1)。这在实现上要比逐项检查更简单。','utf-8'),(69,'= 回文数 =\n\n== 题目描述 ==\n\n一个正整数从左、右来读都是一样的，则称为回文式数(简称回数)； 比如101，32123，999都是回数 输入一个数，判断他是不是回文数，是输出Y，否输出N。\n\n== 输入 ==\n\n每行一个正整数N，其中N<2<sup>31</sup>\n\n== 输出 ==\n\n每行一个字符Y或N\n\n== 样例输入 ==\n<pre>101\n32123\n401\n999\n</pre>\n== 样例输出 ==\n<pre>Y\nY\nN\nY\n</pre>\n= 题解 =\n\n== 分析 ==\n\n设计这道题的目的，在于提醒大家执行程序的是机器，不是人。这道题如果真的按题目要求使用整数进行判断，自然能够AC，但是编码过程何其漫长！重新读一下题目，判定一个序列是否为回文序列的唯一依据就是这个序列从是否来回读是一样的，而且题目给定了输入数据的范围，那么我们可以考虑用字符串的形式读入这个整数，然后判定从两端读取的序列是否一样——如果字符串s的长度为n，那么就是要保证对于任意的i<=n-1-i,都有s(i)==s(n-i-1)。这在实现上要比逐项检查更简单。','utf-8'),(70,'= 题解 =\n\n== 分析 ==\n\n图形用一个二维字符数组存储。\n\n不考虑最终的图形是什么，绘制每一个方块，我们需要注意的仅仅是绘制的顺序。\n\n因此，我们来考察加入一个方块时图形的变化\n\n以下图为例\n<pre>..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n</pre>\n新加入一个方块有10种可能的位置，产生9种图形：\n<pre>..+---+---+---+\n./   /   /   /|\n+---+---+---+ |\n|   |   |   | +\n|   |   |   |/.\n+---+---+---+..\n</pre><pre>....+---+---+\n.../   /   /|\n..+---+---+ |\n./   /|   | +\n+---+ |   |/.\n|   | +---+..\n|   |/.......\n+---+........\n</pre><pre>..+---+---+\n./   /   /|\n+---+---+ |\n|  /   /| +\n| +---+ |/.\n+-|   | +..\n..|   |/...\n..+---+....\n</pre><pre>....+---+..\n.../   /|..\n..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n</pre><pre>........+---+\n......./   /|\n..+---+---+ |\n./   /   /| +\n+---+---+ |/.\n|   |   | +..\n|   |   |/...\n+---+---+....\n</pre><pre>..+---+....\n./   /|....\n+---+ |....\n|   | +---+\n|   |/   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n</pre><pre>......+---+\n...../   /|\n....+---+ |\n..+-|   | +\n./  |   |/|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n</pre><pre>..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n|   | +....\n|   |/.....\n+---+......\n</pre><pre>..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/|\n+---+---+ |\n....|   | +\n....|   |/.\n....+---+..\n</pre>\n可以发现，如果把新方块放在原来的可见面上，则新方块在新图形中具有完整的方块外形。\n\n由于可见面存在于右、前、上三个方向，于是我们得出绘制策略：从左后下方向右前上方扩展\n\n具体实现可以是：从第1行到第m行，从1到n列依序从低到顶绘制方块，每一次绘制直接覆盖对应位置的图形。\n\n== 样例代码 ==\n<pre>#include <cstdio>\n\nint const MAX_MAP_SIZE = 100 + 0xF;\nint const MAX_CANVAS_SIZE = MAX_MAP_SIZE * 6;\n\nchar const PROTOTYPE[6][7] = {\n	{\'.\',\'.\',\'+\',\'-\',\'-\',\'-\',\'+\'},\n	{\'.\',\'/\',\' \',\' \',\' \',\'/\',\'|\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\' \',\'|\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\' \',\'+\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\'/\',\'.\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\'.\',\'.\'}\n};\n\nint map[MAX_MAP_SIZE][MAX_MAP_SIZE];\n\nchar canvas[MAX_CANVAS_SIZE][MAX_CANVAS_SIZE];\n\ninline void max_ref(int&a, int b) { if (a<b) { a = b; } }\ninline void min_ref(int&a, int b) { if (a>b) { a = b; } }\n\nvoid draw_cube(int x, int y) {\n	for (int i=0; i<6; ++i) {\n		for (int j=0; j<7; ++j) {\n			if (PROTOTYPE[5-i][j]&nbsp;!= \'.\') {\n				canvas[x+i][y+j] = PROTOTYPE[5-i][j];\n			}\n		}\n	}\n}\n\nvoid draw_stack(int x, int y, int n) {\n	for (int i=0, tx=x; i<n; ++i, tx+=3) {\n		draw_cube(tx,y);\n	}\n}\n\nvoid draw_row(int x, int y, int r, int n){\n	for (int i=0, ty=y; i<n; ++i, ty+=4) {\n		draw_stack(x, ty, map[r][i]);\n	}\n}\n\nbool search(int r) {\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		if (canvas[r][i]&nbsp;!= \'.\') {\n			return false;\n		}\n	}\n	return true;\n}\n\nint main() {\n	int m=0,n=0;\n	scanf(\"%d%d\", &m, &n);\n\n	for (int i=0; i<m; ++i) {\n		for (int j=0; j<n; ++j) {\n			scanf(\"%d\", &map[i][j]);\n		}\n	}\n\n\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		for (int j=0; j<MAX_CANVAS_SIZE; ++j) {\n			canvas[i][j]=\'.\';\n		}\n	}\n\n	int x0=2*m-2, y0=2*m-2;\n\n\n	for (int i=0; i<m; x0-=2, y0-=2, ++i) {\n		draw_row(x0, y0, i, n);\n	}\n\n	int mxl = 0, mxh = MAX_CANVAS_SIZE - 1;\n	int myl = MAX_CANVAS_SIZE - 1, myh = 0;\n\n	while(search(mxl)) {\n		++mxl;\n	}\n\n    while(search(mxh)) {\n		--mxh;\n    }\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=0; j<myl; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				min_ref(myl,j);\n			}\n		}\n	}\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=myh; j<MAX_CANVAS_SIZE; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				max_ref(myh,j);\n			}\n		}\n	}\n\n	for (int i=mxh; i>=mxl; --i) {\n		for (int j=myl; j<=myh; ++j) {\n			putchar(canvas[i][j]);\n		}\n		putchar(\'\\n\');\n	}\n}\n\n</pre>','utf-8'),(71,'= 题解 =\n\n== 分析 ==\n\n图形用一个二维字符数组存储。\n\n不考虑最终的图形是什么，绘制每一个方块，我们需要注意的仅仅是绘制的顺序。\n\n因此，我们来考察加入一个方块时图形的变化\n\n以下图为例\n<pre>..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n</pre>\n新加入一个方块有10种可能的位置，产生9种图形：\n<pre>..+---+---+---+\n./   /   /   /|\n+---+---+---+ |\n|   |   |   | +\n|   |   |   |/.\n+---+---+---+..\n\n....+---+---+\n.../   /   /|\n..+---+---+ |\n./   /|   | +\n+---+ |   |/.\n|   | +---+..\n|   |/.......\n+---+........\n\n..+---+---+\n./   /   /|\n+---+---+ |\n|  /   /| +\n| +---+ |/.\n+-|   | +..\n..|   |/...\n..+---+....\n\n....+---+..\n.../   /|..\n..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n\n........+---+\n......./   /|\n..+---+---+ |\n./   /   /| +\n+---+---+ |/.\n|   |   | +..\n|   |   |/...\n+---+---+....\n\n..+---+....\n./   /|....\n+---+ |....\n|   | +---+\n|   |/   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n\n......+---+\n...../   /|\n....+---+ |\n..+-|   | +\n./  |   |/|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n\n..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/.\n+---+---+..\n|   | +....\n|   |/.....\n+---+......\n\n..+---+---+\n./   /   /|\n+---+---+ |\n|   |   | +\n|   |   |/|\n+---+---+ |\n....|   | +\n....|   |/.\n....+---+..\n</pre>\n可以发现，如果把新方块放在原来的可见面上，则新方块在新图形中具有完整的方块外形。\n\n由于可见面存在于右、前、上三个方向，于是我们得出绘制策略：从左后下方向右前上方扩展\n\n具体实现可以是：从第1行到第m行，从1到n列依序从低到顶绘制方块，每一次绘制直接覆盖对应位置的图形。\n\n== 样例代码 ==\n<pre>#include <cstdio>\n\nint const MAX_MAP_SIZE = 100 + 0xF;\nint const MAX_CANVAS_SIZE = MAX_MAP_SIZE * 6;\n\nchar const PROTOTYPE[6][7] = {\n	{\'.\',\'.\',\'+\',\'-\',\'-\',\'-\',\'+\'},\n	{\'.\',\'/\',\' \',\' \',\' \',\'/\',\'|\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\' \',\'|\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\' \',\'+\'},\n	{\'|\',\' \',\' \',\' \',\'|\',\'/\',\'.\'},\n	{\'+\',\'-\',\'-\',\'-\',\'+\',\'.\',\'.\'}\n};\n\nint map[MAX_MAP_SIZE][MAX_MAP_SIZE];\n\nchar canvas[MAX_CANVAS_SIZE][MAX_CANVAS_SIZE];\n\ninline void max_ref(int&a, int b) { if (a<b) { a = b; } }\ninline void min_ref(int&a, int b) { if (a>b) { a = b; } }\n\nvoid draw_cube(int x, int y) {\n	for (int i=0; i<6; ++i) {\n		for (int j=0; j<7; ++j) {\n			if (PROTOTYPE[5-i][j]&nbsp;!= \'.\') {\n				canvas[x+i][y+j] = PROTOTYPE[5-i][j];\n			}\n		}\n	}\n}\n\nvoid draw_stack(int x, int y, int n) {\n	for (int i=0, tx=x; i<n; ++i, tx+=3) {\n		draw_cube(tx,y);\n	}\n}\n\nvoid draw_row(int x, int y, int r, int n){\n	for (int i=0, ty=y; i<n; ++i, ty+=4) {\n		draw_stack(x, ty, map[r][i]);\n	}\n}\n\nbool search(int r) {\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		if (canvas[r][i]&nbsp;!= \'.\') {\n			return false;\n		}\n	}\n	return true;\n}\n\nint main() {\n	int m=0,n=0;\n	scanf(\"%d%d\", &m, &n);\n\n	for (int i=0; i<m; ++i) {\n		for (int j=0; j<n; ++j) {\n			scanf(\"%d\", &map[i][j]);\n		}\n	}\n\n\n	for (int i=0; i<MAX_CANVAS_SIZE; ++i) {\n		for (int j=0; j<MAX_CANVAS_SIZE; ++j) {\n			canvas[i][j]=\'.\';\n		}\n	}\n\n	int x0=2*m-2, y0=2*m-2;\n\n\n	for (int i=0; i<m; x0-=2, y0-=2, ++i) {\n		draw_row(x0, y0, i, n);\n	}\n\n	int mxl = 0, mxh = MAX_CANVAS_SIZE - 1;\n	int myl = MAX_CANVAS_SIZE - 1, myh = 0;\n\n	while(search(mxl)) {\n		++mxl;\n	}\n\n    while(search(mxh)) {\n		--mxh;\n    }\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=0; j<myl; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				min_ref(myl,j);\n			}\n		}\n	}\n\n	for (int i=mxl; i<=mxh; ++i) {\n		for (int j=myh; j<MAX_CANVAS_SIZE; ++j) {\n			if (canvas[i][j]&nbsp;!= \'.\') {\n				max_ref(myh,j);\n			}\n		}\n	}\n\n	for (int i=mxh; i>=mxl; --i) {\n		for (int j=myl; j<=myh; ++j) {\n			putchar(canvas[i][j]);\n		}\n		putchar(\'\\n\');\n	}\n}\n</pre>','utf-8'),(72,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n::*[[赛前练习]]\n\n:SSSTA生态\n::*[[实验室]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(73,'= 关于 =\n赛前练习是+x大神用来游戏苍生的Contest。\n= 题目列表 =\n*[[四位数分解]]\n*[[约数求和]]\n*[[最大值]]\n*[[阶乘求和]]\n*[[高精a+b]]\n*[[数字时钟]]\n*[[统计单词的个数]]','utf-8'),(74,'= 参考标程 =\n<pre>\n#include <stdio.h>\nchar *k[8]={\"    +\",\"+   +\",\"+---+\",\"    |\",\"|    \",\"|   |\",\"o\",\" \"};\nint c[11][7]={2,5,5,1,5,5,2,0,3,3,0,3,3,0,2,3,3,2,4,4,2,2,3,3,2,3,3,2,1,5,5,2,3,3,0,2,4,4,2,3,3,2,2,4,4,2,5,5,2,2,3,3,0,3,3,0,2,5,5,2,5,5,2,2,5,5,2,3,3,2,7,7,6,7,6,7,7};\nchar u[9]={0};\nvoid f()\n{\n	int l,r;\n	for(l=0; l<7; ++l)\n		for(r=0; r<8; ++r)\n			printf(r!=7?\"%s  \":l!=6?\"%s\\n\":\"%s\\n\\n\",k[c[u[r] ==\':\'?10:u[r]-\'0\'][l]]);\n}\nint main()\n{\n	while(scanf(\"%s\",u)!=EOF)f();\n	printf(\"end\");\n	return 0;\n}\n</pre>','utf-8'),(75,'= 分析 =\n这种坑爹打表题主要是细心检查输出格式是不是严格符合题目要求，在有就是打好表...\n= 参考标程 =\n<pre>\n#include <stdio.h>\nchar *k[8]={\"    +\",\"+   +\",\"+---+\",\"    |\",\"|    \",\"|   |\",\"o\",\" \"};\nint c[11][7]={2,5,5,1,5,5,2,0,3,3,0,3,3,0,2,3,3,2,4,4,2,2,3,3,2,3,3,2,1,5,5,2,3,3,0,2,4,4,2,3,3,2,2,4,4,2,5,5,2,2,3,3,0,3,3,0,2,5,5,2,5,5,2,2,5,5,2,3,3,2,7,7,6,7,6,7,7};\nchar u[9]={0};\nvoid f()\n{\n	int l,r;\n	for(l=0; l<7; ++l)\n		for(r=0; r<8; ++r)\n			printf(r!=7?\"%s  \":l!=6?\"%s\\n\":\"%s\\n\\n\",k[c[u[r] ==\':\'?10:u[r]-\'0\'][l]]);\n}\nint main()\n{\n	while(scanf(\"%s\",u)!=EOF)f();\n	printf(\"end\");\n	return 0;\n}\n</pre>','utf-8'),(76,'= 分析 =\n这种坑爹打表题主要是需要细心检查输出格式是不是严格符合题目要求，再有就是打好表...\n\n= 参考标程 =\n<pre>\n#include <stdio.h>\nchar *k[8]={\"    +\",\"+   +\",\"+---+\",\"    |\",\"|    \",\"|   |\",\"o\",\" \"};\nint c[11][7]={2,5,5,1,5,5,2,0,3,3,0,3,3,0,2,3,3,2,4,4,2,2,3,3,2,3,3,2,1,5,5,2,3,3,0,2,4,4,2,3,3,2,2,4,4,2,5,5,2,2,3,3,0,3,3,0,2,5,5,2,5,5,2,2,5,5,2,3,3,2,7,7,6,7,6,7,7};\nchar u[9]={0};\nvoid f()\n{\n	int l,r;\n	for(l=0; l<7; ++l)\n		for(r=0; r<8; ++r)\n			printf(r!=7?\"%s  \":l!=6?\"%s\\n\":\"%s\\n\\n\",k[c[u[r] ==\':\'?10:u[r]-\'0\'][l]]);\n}\nint main()\n{\n	while(scanf(\"%s\",u)!=EOF)f();\n	printf(\"end\");\n	return 0;\n}\n</pre>','utf-8'),(77,'= 分析 =\n这种坑爹打表题主要是需要细心检查输出格式是不是严格符合题目要求，再有就是打好表...\n\n= 参考标程 =\n<pre>\n#include <stdio.h>\nchar *k[8]={\"    +\",\"+   +\",\"+---+\",\"    |\",\"|    \",\"|   |\",\"o\",\" \"};\nint c[11][7]={2,5,5,1,5,5,2,0,3,3,0,3,3,0,2,3,3,2,4,4,2,2,3,3,2,3,3,2,1,5,5,2,3,3,0,2,4,4,2,3,3,2,2,4,4,2,5,5,2,2,3,3,0,3,3,0,2,5,5,2,5,5,2,2,5,5,2,3,3,2,7,7,6,7,6,7,7};\nchar u[9]={0};\nvoid f()\n{\n	int l,r;\n	for(l=0; l<7; ++l)\n		for(r=0; r<8; ++r)\n			printf(r!=7?\"%s  \":l!=6?\"%s\\n\":\"%s\\n\\n\",k[c[u[r] ==\':\'?10:u[r]-\'0\'][l]]);\n}\nint main()\n{\n	while(scanf(\"%s\",u)!=EOF)f();\n	printf(\"end\");\n	return 0;\n}\n</pre>\n<pre>\n#include <cstdio>\n\nint const HEIGHT = 7;\nint const DIGIT_W = 5;\nint const GAP_W = 2;\nint const DOT_W = 1;\nint const SCREEN_W = DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W + DIGIT_W;\n\nchar const DIGITS[10][HEIGHT][DIGIT_W+1] = {\n	{\n		\"+---+\",\n		\"|   |\",\n		\"|   |\",\n		\"+   +\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\"\n	}, {\n		\"    +\",\n		\"    |\",\n		\"    |\",\n		\"    +\",\n		\"    |\",\n		\"    |\",\n		\"    +\"\n	}, {\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"+---+\",\n		\"|    \",\n		\"|    \",\n		\"+---+\"\n	}, {\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"+---+\"\n	}, {\n		\"+   +\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"    +\"\n	}, {\n		\"+---+\",\n		\"|    \",\n		\"|    \",\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"+---+\"\n	}, {\n		\"+---+\",\n		\"|    \",\n		\"|    \",\n		\"+---+\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\"\n	},  {\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"    +\",\n		\"    |\",\n		\"    |\",\n		\"    +\"\n	}, {\n		\"+---+\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\"\n	}, {\n		\"+---+\",\n		\"|   |\",\n		\"|   |\",\n		\"+---+\",\n		\"    |\",\n		\"    |\",\n		\"+---+\"\n	}\n};\n\nchar const DOT[HEIGHT][DOT_W+1] = {\n	\" \",\n	\" \",\n	\"o\",\n	\" \",\n	\"o\",\n	\" \",\n	\" \"\n};\n\nint const DOT_POS[] = {\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W,\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W + DIGIT_W + GAP_W\n};\n\nint const DIGIT_POS[] = {\n	0,\n	DIGIT_W + GAP_W,\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W,\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W,\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W,\n	DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W + DIGIT_W + GAP_W + DOT_W + GAP_W + DIGIT_W + GAP_W\n};\n\nchar time[9];\nchar screen[HEIGHT][SCREEN_W+1];\n\nvoid print_digit(int pos, int digit) {\n	for (int i=0; i<HEIGHT; ++i) {\n		for (int j=0; j<DIGIT_W; ++j) {\n			screen[i][DIGIT_POS[pos]+j] = DIGITS[digit][i][j];\n		}\n	}\n}\n\nvoid print_dot(int pos) {\n	for (int i=0; i<HEIGHT; ++i) {\n		for (int j=0; j<DOT_W; ++j) {\n			screen[i][j+DOT_POS[pos]] = DOT[i][j];\n		}\n	}\n}\n\nvoid print_time(int h1, int h2, int m1, int m2, int s1, int s2) {\n	print_digit(0, h1);\n	print_digit(1, h2);\n	print_dot(0);\n	print_digit(2, m1);\n	print_digit(3, m2);\n	print_dot(1);\n	print_digit(4, s1);\n	print_digit(5, s2);\n}\n\nvoid display_screen() {\n	for (int i=0; i<HEIGHT; ++i) {\n		puts(screen[i]);\n	}\n}\n\nvoid clear_screen() {\n	for (int i=0; i<HEIGHT; ++i) {\n		for(int j=0; j<SCREEN_W; ++j) {\n			screen[i][j] = \' \';\n		}\n	}\n}\n\nint main() {\n	for (; scanf(\"%s\", time) != EOF; puts(\"\")) {\n		clear_screen();\n		int h1 = time[0] - \'0\';\n		int h2 = time[1] - \'0\';\n		int m1 = time[3] - \'0\';\n		int m2 = time[4] - \'0\';\n		int s1 = time[6] - \'0\';\n		int s2 = time[7] - \'0\';\n		print_time(h1, h2, m1, m2, s1, s2);\n		display_screen();\n	}\n	puts(\"end\");\n	return 0;\n}\n</pre>','utf-8'),(78,'= 题解 =\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">关于bell数，可以看下方的链接</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">[http://zh.wikipedia.org/wiki/%E8%B4%9D%E5%B0%94%E6%95%B0 Bell数]</span></span>\n\n<span class=\"Apple-style-span\" style=\"border-collapse: separate;  color: rgb(0, 0, 0);  font-family: \'Times New Roman\';  font-style: normal;  font-variant: normal;  font-weight: normal;  letter-spacing: normal;  line-height: normal;  orphans: 2;  text-align: auto;  text-indent: 0px;  text-transform: none;  white-space: normal;  widows: 2;  word-spacing: 0px;  -webkit-border-horizontal-spacing: 0px;  -webkit-border-vertical-spacing: 0px;  -webkit-text-decorations-in-effect: none;  -webkit-text-size-adjust: auto;  -webkit-text-stroke-width: 0px;  font-size: medium\"><span class=\"Apple-style-span\" style=\"color: rgb(51, 51, 51);  font-family: Helvetica, arial, freesans, clean, sans-serif;  font-size: 14px;  line-height: 22px\">我们使用贝尔三角形来计算这个问题，由于只会问1-1000个bell数，所以我们提前计算好所有1000个bell数，直接输出即可，否则每次都计算会超时</span></span>\n\n\n\n= 例程 =\n<pre style=\"margin-top: 15px;  margin-right: 0px;  margin-bottom: 15px;  margin-left: 0px;  padding-top: 6px;  padding-right: 10px;  padding-bottom: 6px;  padding-left: 10px;  border-top-width: 1px;  border-right-width: 1px;  border-bottom-width: 1px;  border-left-width: 1px;  border-style: initial;  border-color: initial;  font-size: 13px;  font-family: Consolas, \'Liberation Mono\', Courier, monospace;  background-color: rgb(248, 248, 248);  border-top-style: solid;  border-right-style: solid;  border-bottom-style: solid;  border-left-style: solid;  border-top-color: rgb(204, 204, 204);  border-right-color: rgb(204, 204, 204);  border-bottom-color: rgb(204, 204, 204);  border-left-color: rgb(204, 204, 204);  line-height: 19px;  overflow-x: auto;  overflow-y: auto;  border-top-left-radius: 3px 3px;  border-top-right-radius: 3px 3px;  border-bottom-right-radius: 3px 3px;  border-bottom-left-radius: 3px 3px\">#include<stdio.h>\nint bell[1002][1002];\nint main() {\n	int i, j, n;\n	bell[0][0]=1;\n	for (i=1; i<1000; ++i) {\n		bell[i][0] = bell[i-1][i-1];\n		for (j=1; j<=i; ++j) {\n			bell[i][j] = (bell[i][j-1] + bell[i-1][j-1]) % 100000007;\n		}\n	}\n	for(; scanf(\"%d\", &n) != EOF;) {\n		printf(\"%d\\n\", bell[n][0]);\n	}\n	return 0;\n}</pre>','utf-8'),(79,'= 题解 = \n\n题目就不翻译了\n\n题意：给定k,l,求出自然数n，使得kn=l，如果n不存在，输出NO。\n\n思路；已知底数和幂,求指数,每次判断l能被k整除，如果不能，则输出NO，如果可以则更新l的值，l=l/k,再次判断，直到l<=k,如果l==k,则输出循环执行了多少次，即n,否则输出no。\n\n= 例程 =\n\n<pre>\n#include<stdio.h>\n#include<stdlib.h>\nint main() {\n	int k,n,s;\n	for(; scanf(\"%d%d\", &k, &n) != EOF; ) {\n		s=0;\n		for(s=0; n>k&&n%k==0; ++s) {\n			n=n/k;\n		}\n		if(n!=k) {\n			puts(\"NO\");\n		} else {\n			printf(\"YES %d\\n\", s);\n		}\n	}\n	return 0;\n}\n</pre>','utf-8'),(80,'= 神VS神之1 =\n\n== 题目描述 ==\n\n大蒋神和大飞神要一决胜负\n\n他们用剪刀锤子布的方式比试\n\n请你编程来判断谁赢了\n\n== 输入 ==\n\n多组数据\n\nS表示剪刀\n\nR表示石头\n\nP表示布\n\n先后输入大蒋神和大飞神出的结果\n\nEOF结尾\n\n== 输出 ==\n\n对每组数据\n\n大蒋神获胜输出\"J\"\n\n大飞神获胜输出\"F\"\n\n平局输出\"W\"\n\n== 样例输入 ==\n\nR S\n\nS R\n\nP P\n\n== 样例输出 ==\n\nJ\n\nF\n\nW\n\n= 题解 =\n\n== 分析 ==\n\n看起来不难是吧。\n\n但是，\n\n输入输出的处理上坑了不少人。\n\n正确的姿势是怎样的呢？\n<pre>scanf(\"%c&nbsp;%c\\n\", &a, &b)\n</pre>\n或\n<pre>scanf(\"%s&nbsp;%s\", &a, &b)\n</pre>\n\n== 例程 ==\n<pre>#include<cstdio>\nint const JUDGE[3][3]={\n	{1, 2, 0},\n	{0, 1, 2},\n	{2, 0, 1}\n};\nchar const RESULT[4]=\"JWF\";\n\nint magic_hash(char c) {\n	/*\n	 *  same as\n	 *  if (c == \'R\') {\n	 *  	return 0;\n	 *  } else if (c == \'P\') {\n	 *  	return 1;\n	 *  } else if (c == \'S\') {\n	 *  	return 2;\n	 *  } else {\n	 *  	return \"Sorry, I dont\'t know.\";\n	 *  }\n	 */\n	return c%2 + c%3 - 1;\n}\n\nint main(){\n	for (char a, b; scanf(\"%c&nbsp;%c\\n\",&a,&b)&nbsp;!= EOF; ) {\n		printf(\"%c\\n\", RESULT[JUDGE[magic_hash(a)][magic_hash(b)]]);\n	}\n	return 0;\n}\n</pre>','utf-8'),(81,'dfsdsfdsf  f d dssfd dsff sdftest test','utf-8'),(82,'789','utf-8'),(83,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n::*[[赛前练习]]\n\n:SSSTA生态\n::*[[实验室123]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(84,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n::*[[赛前练习]]\n\n:SSSTA生态\n::*[[实验室]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(85,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n::*[[赛前练习]]\n\n:SSSTA生态\n::*[[实验室]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒123]]\n::*[[Wiki君日记]]','utf-8'),(86,'<span style=\"font-size:x-large;\">\'\'\'欢迎来到SSSTA-Wiki\'\'\'</span>\n\n----\n\n== Wiki君的迷之优选 ==\n\n:题解系列\n::*[[First Contest]]\n::*[[2013国庆N题斩]]\n::*[[赛前练习]]\n\n:SSSTA生态\n::*[[实验室]]\n\n:SSSTA编年史修编计划\n::*[[诸神之怒]]\n::*[[Wiki君日记]]','utf-8'),(87,'123789','utf-8');
